INSERT INTO `cmsutils_productionchunk` VALUES ('adeptra-contact','0203 365 0133','adeptra contact',1,1,'2016-05-10 18:51:21.075617','2016-05-10 18:51:28.693993','2016-05-10 18:51:41.230429',1,2,''),('AE','Your payment(s) are overdue','AE',1,2,'2016-05-01 07:53:26.589654','2016-05-01 07:53:26.590623','2016-05-01 07:54:11.502385',2,2,''),('AE-Content','<div class=\"ci_modal_msg\">Your payment(s) are overdue</div>\r\n<div class=\"ci_modal_return row\">										<div class=\"col-md-4 col-md-offset-4 col-xs-6 col-xs-offset-3\">											<button type=\"button\" class=\"btn ci_btn_green_full\" href=\'/consumer/makepayment/\'>Pay Now</button>\r\n										</div>									</div>','AE-Content',1,2,'2016-05-01 07:53:26.589654','2016-05-01 07:53:26.590623','2016-05-01 11:26:37.782102',5,2,''),('AE-Header','ARREAR','AE-Header',1,2,'2016-05-01 10:43:56.029308','2016-05-01 10:43:56.030287','2016-05-01 10:51:36.694617',2,2,''),('AE-Message-Header','<a href=\'/consumer/makepayment/\'>                                            <i class=\"fa fa-pencil-square-o ci_msg_lft_ico\"></i>                                            <span class=\"ci_msg_dd_link_txt\">Your payment(s) are overdue</span>                                        </a>','Arrear Message',1,5,'2016-05-01 14:53:56.186889','2016-05-01 14:53:56.187905','2016-05-01 14:54:21.334738',5,2,''),('alert-msg','test2','alert-msg',1,3,'2016-03-24 11:53:38.333949','2016-03-24 11:53:38.335769','2016-03-24 11:53:48.388902',3,2,''),('ApprovalPagesNumber','0203 365 0133','Adeptra number',1,2,'2016-03-15 16:34:55.881008','2016-03-15 16:34:55.881626','2016-03-15 16:35:00.364738',2,2,''),('Apr25','1272.0','changing the APR for DI product',1,2,'2016-03-15 16:33:45.447328','2016-03-15 16:33:45.449020','2016-03-15 16:33:51.535088',2,2,''),('Apr456','1272.0','changing the APR for DI product',1,2,'2016-03-15 16:36:54.533172','2016-03-15 16:36:54.533978','2016-03-15 16:36:59.961546',2,2,''),('APRDI','1325','apr for DI',1,2,'2016-03-15 16:35:55.111432','2016-03-15 16:35:55.112196','2016-03-15 16:35:59.972424',2,2,''),('APREMI','1325','apr for EMI',1,2,'2016-03-15 16:35:55.111432','2016-03-15 16:35:55.112196','2016-03-15 16:35:59.972424',2,2,''),('APR_LOC','89.7','APR value of LOC',1,2,'2016-03-15 16:34:19.506724','2016-03-15 16:34:19.507414','2016-03-15 16:34:24.948684',2,2,''),('BAW1','<p>Hi {{overview_details.username}}, . \r\n<br>You can apply for up to &pound;1500.</p>\r\n<a href=\'/consumer/pending/\' class=\"ci_green_link ci_banner_btn\">Start an application today &nbsp;<i class=\"fa fa-chevron-right\"></i></a>\r\n','BAW1',1,2,'2016-04-12 04:51:13.163828','2016-04-12 04:51:13.164758','2016-04-27 12:48:26.213533',5,2,''),('BAW10','<p>Hi {{overview_details.username}}, \r\n<br>You have a repayment due on {{overview_details.account_summary.next_due_date}}. If you have automatic payments enabled, your account will be debited, otherwise</p>\r\n<a href=\'/consumer/makepayment/\' class=\"ci_green_link ci_banner_btn\">Make A Payment Now &nbsp;<i class=\"fa fa-chevron-right\"></i></a>\r\n','BAW10',1,2,'2016-04-12 04:53:55.402383','2016-04-12 04:53:55.403258','2016-04-29 13:39:26.302164',2,2,''),('BAW2','<p>Hi {{overview_details.username}}, \r\n<br>You have a pending loan application. \r\n<a href={{pending_application_link}} class=\"ci_green_link ci_banner_btn\">Continue your application now &nbsp;<i class=\"fa fa-chevron-right\"></i></a>\r\n','BAW2',1,2,'2016-04-12 04:51:29.089311','2016-04-12 04:51:29.090197','2016-04-27 12:47:47.861603',5,2,''),('BAW3','<p>Hi {{overview_details.username}},  \r\n<br>You have an upcoming repayment due on {{overview_details.account_summary.next_due_date}}. If you have automatic payments enabled, your account will be debited, otherwise <p><br>\r\n<a href=\'/consumer/makepayment/\' class=\"ci_green_link ci_banner_btn\">Make A Payment Now &nbsp;<i class=\"fa fa-chevron-right\"></i></a>\r\n','BAW3',1,2,'2016-04-12 04:51:47.900792','2016-04-12 04:51:47.901666','2016-04-29 13:38:34.528558',2,2,''),('BAW4','<p>Hi {{overview_details.username}}, \r\n<br>You currently have no open loans with us.</p>\r\n<a href=\'/consumer/transactionhistory/\' class=\"ci_green_link ci_banner_btn\">View your account history &nbsp;<i class=\"fa fa-chevron-right\"></i></a>\r\n','BAW4',1,2,'2016-04-12 04:52:06.413950','2016-04-12 04:52:06.414800','2016-04-27 13:28:30.317131',5,2,''),('BAW5','<p>Hi {{overview_details.username}},\r\n<br>You have an upcoming repayment due on {{overview_details.account_summary.next_due_date}}. If you have automatic payments enabled, your account will be debited, otherwise</p><br>\r\n<a href=\'/consumer/makepayment/\' class=\"ci_green_link ci_banner_btn\">Make A Payment Now &nbsp;<i class=\"fa fa-chevron-right\"></i></a>\r\n\r\n','BAW5',1,2,'2016-04-12 04:52:21.981756','2016-04-12 04:52:21.982650','2016-04-29 13:40:42.807416',2,2,''),('BAW6','<p>Hi {{overview_details.username}}, \r\n<br>It seems your account is in arrears.</p> \r\n<a href=\'/consumer/makepayment/\' class=\"ci_green_link ci_banner_btn\">Make A Payment Now &nbsp;<i class=\"fa fa-chevron-right\"></i></a>\"\r\n','BAW6',1,2,'2016-04-12 04:52:42.827178','2016-04-12 04:52:42.828713','2016-04-27 12:46:28.752977',5,2,''),('BAW7','<p>Hi {{overview_details.username}}, \r\n<br>It seems your account is in a debt management program.</p> \r\n<a href=\'/consumer/makepayment/\' class=\"ci_green_link ci_banner_btn\">Make A Payment Now &nbsp;<i class=\"fa fa-chevron-right\"></i></a>\r\n','BAW7',1,2,'2016-04-12 04:52:58.608770','2016-04-12 04:52:58.610118','2016-04-27 12:45:58.283495',5,2,''),('BAW8','<p> Hi {{overview_details.username}},\r\n<br>Is your personal information up to date?</p>\r\n<a href=\'/consumer/profile/\' class=\'ci_green_link ci_banner_btn\'>Update your info now &nbsp; <i class=\"fa fa-chevron-right\"></i></a>\r\n','BAW8',1,2,'2016-04-12 04:53:19.077022','2016-04-12 04:53:19.077924','2016-04-27 12:45:40.720949',5,2,''),('BAW9','<p>Hi {{overview_details.username}}, \r\n<br>You have a settlement offer of {{overview_details.settlement_offer}}% on loan(s):{{overview_details.loan_ids}}.</p>\r\n<a href=/consumer/makepayment/?settlement=1 class=\"ci_green_link ci_banner_btn\">Settle your loan(s) today &nbsp;<i class=\"fa fa-chevron-right\"></i></a>\r\n*This offer is applicable only when paying your settlement offer in full\r\n','BAW9',1,2,'2016-04-12 04:53:35.327524','2016-04-12 04:53:35.328660','2016-04-27 12:43:40.118186',5,2,''),('callcreditlink','http://www.callcredit.co.uk/','Link for Call Credit',1,2,'2016-03-15 21:06:21.260381','2016-03-15 21:06:21.262466','2016-03-15 21:06:26.643994',2,2,''),('contact-address','<p>Lending Stream,<br/>\r\nWisteria  Grange Barn,<br/>\r\nPikes End, Pinner,<br/>\r\nLondon, United Kingdom,<br/>\r\nHA5 2EX,<br/>\r\nTelephone: 0203 365 0133 <br/>\r\nEmail address: <u>info@lendingstream.co.uk</u></p>\r\n','lender contact address in top of the page',1,1,'2016-04-22 18:27:33.186079','2016-04-22 18:27:33.187033','2016-05-18 03:56:40.921512',1,2,''),('contact-address-single-line','Wisteria Grange Barn, Pikes End, Pinner, London, United Kingdom, HA5 2EX','lender contact address in single line',1,1,'2016-04-22 18:32:30.679157','2016-04-22 18:32:30.680250','2016-05-10 14:41:15.468323',1,2,''),('contactus-url','<a href = \"https://www.lendingstream.co.uk/contactus/\">https://www.lendingstream.co.uk/contactus/</a>','contact us url',1,1,'2018-09-13 09:00:21.159029','2018-09-13 09:00:21.162877','2018-09-13 09:00:21.162881',1,1,'approved'),('DE','Your debit card is expiring soon','DE',1,2,'2016-05-01 06:54:06.535995','2016-05-01 06:54:06.537046','2016-05-01 07:00:37.951418',2,2,''),('DE-Content','<div class=\"ci_modal_msg\">Your debit card is expiring soon.</div>\r\n<div class=\"ci_modal_return row\">										<div class=\"col-md-4 col-md-offset-4 col-xs-6 col-xs-offset-3\">											<button type=\"button\" class=\"btn ci_btn_green_full debit_card \">Update debit card</button>\r\n										</div>									</div>\r\n\r\n','DE-Content',1,2,'2016-05-01 06:54:06.535995','2016-05-01 06:54:06.537046','2016-05-01 11:34:27.122145',5,2,''),('DE-Header','DEBIT CARD EXPIRING','DE-Header',1,2,'2016-05-01 10:46:27.965640','2016-05-01 10:46:27.967309','2016-05-01 10:51:36.418293',2,2,''),('DE-Message-Header','<a class=\'debit_card\'>                                            <i class=\"fa fa-pencil-square-o ci_msg_lft_ico\"></i>                                            <span class=\"ci_msg_dd_link_txt\">Your debit card is expiring soon.</span>                                        </a>','update debit card message',1,5,'2016-05-01 14:51:13.175505','2016-05-01 14:51:13.176681','2016-05-01 14:51:33.292693',5,2,''),('experianlink','http://www.experian.co.uk/','experian link',1,2,'2016-03-15 21:06:52.046749','2016-03-15 21:06:52.047748','2016-03-15 21:06:57.040736',2,2,''),('FAQ1-Answer','<li>\r\n                                <p>A representative example is a financial concept that is designed to help you understand all of the costs and charges of taking out credit or a loan.</p>\r\n                                <p>The below information shows a representative example of a 6 month loan with Lending Stream.</p>\r\n                                <h4 class=\"ci_pad_top20 ci_pad_bot20\">Representative Example</h4>\r\n                                <ul class=\"ci_faq_subli\">\r\n                                    <li>Annual Interest Rate: 292.0% (Fixed)</li>\r\n                                    <li>Total amount of credit: &pound200</li>\r\n                                    <li>Representative APR: 1272.0%</li>\r\n                                    <li>Duration of agreement: 6 months</li>\r\n                                    <li>Total amount payable: &pound391.68</li>\r\n                                    <li>Total charge of credit: &pound191.68</li>\r\n                                </ul>\r\n                                <hr>\r\n                                <ul class=\"ci_faq_subli\">\r\n                                    <li>1<sup>st</sup> repayment: &pound46.40</li>\r\n                                    <li>2<sup>nd</sup> repayment: &pound88.00</li>\r\n                                    <li>3<sup>rd</sup> repayment: &pound78.40</li>\r\n                                    <li>4<sup>th</sup> repayment: &pound69.76</li>\r\n                                    <li>5<sup>th</sup> repayment: &pound59.84</li>\r\n                                    <li>6<sup>th</sup> repayment: &pound49.28</li>\r\n                                </ul>\r\n                                <hr>\r\n                                <p>\r\n                                    Our application process is simple. We provide an instant decision and let you know the full amount you are eligible to receive.\r\n                                </p>                               \r\n                            </li>','FAQ1-Answer',1,2,'2016-04-12 00:49:25.932925','2016-04-12 04:03:35.792688','2016-04-12 04:14:58.923432',2,2,''),('FAQ1-Question','What is a representantive example of a Lending Stream Loan?','FAQ1-Question',1,2,'2016-04-12 00:47:59.073891','2016-04-12 04:03:12.299439','2016-04-12 04:14:53.226809',2,2,''),('FAQ10-Answer',' <li>\r\n                                <p>If this is the first time you\'re applying for a Lending Stream loan, you can apply for any amount from &pound;50 to &pound;800. If you\'ve successfully opened a Lending Stream loan, currently or in the past, and your account is in good standing, you can apply for a loan up to &pound;1500.</p>\r\n                                <p>As you go through our simple application process, you choose the amount you need within the above limits. We will do a fast, personalised review of your situation (not just your credit) and provide you with an instant decision. This includes letting you know the full amount you specifically are eligible to receive.</p>\r\n                                <p><a href=\"#\">Fill out the application</a> or log in to your account now to find out how much cash you are eligible to receive as a loan.</p>\r\n                              \r\n                            </li>','FAQ10-Answer',1,2,'2016-04-12 01:03:06.462469','2016-04-12 04:02:31.174529','2016-04-12 04:14:44.625369',2,2,''),('FAQ10-Question','How much money can I borrow if I\'m approved?','FAQ10-Question',1,2,'2016-04-12 00:59:30.828818','2016-04-12 04:02:23.816177','2016-04-12 04:14:39.602524',2,2,''),('FAQ11-Answer','<li>\r\n                                <p>A no fee loan is a financial term that generally refers to the absence of fees for applying for a loan.</p>\r\n                                <p>At Lending Stream, we go a step further and offer short term loans that have no application fees, no transaction fees, and no early payment fees. We have no hidden fees at all. Our only <a href=\"#\">loan fees are related to missed payments.</a></p>\r\n                            </li>','FAQ11-Answer',1,2,'2016-04-12 01:03:51.064406','2016-04-12 04:02:15.765698','2016-04-12 04:14:35.099654',2,2,''),('FAQ11-Question','Do you offer no fee loans?','FAQ11-Question',1,2,'2016-04-12 01:03:28.137047','2016-04-12 04:02:05.495703','2016-04-12 04:14:29.607200',2,2,''),('FAQ12-Answer','<li>\r\n                                <p>A simple way to understand how the total <a href=\"#\">cost of your Lending Stream loan</a> works is to add the following:</p>\r\n                                <p>The amount of cash you borrow</p>\r\n                                <p> + The interest we charge for the time you have the money </p>\r\n                                <p> + <a href=\"#\">Any late fees and additional interest if you miss a payment</a></p>\r\n                                <h5> = The total cost of your Lending Stream loan</h5>\r\n                                <p> You may be able to lower the cost of your loan by repaying it early and reducing interest charges. We clearly spell out all of the costs of your loan up front, and Lending Stream charges no hidden fees. You can also look at a <a href=\"#\">representative example.</a></p>\r\n                                <p>If you know how much cash you need to borrow. Start by filling out our application.</p>\r\n                                \r\n                            </li>','FAQ12-Answer',1,2,'2016-04-12 01:04:35.402948','2016-04-12 04:01:57.500099','2016-04-12 04:13:46.860252',2,2,''),('FAQ12-Question','What is the total amount I\'ll pay for a Lending Stream loan?','FAQ12-Question',1,2,'2016-04-12 01:04:11.814286','2016-04-12 04:01:50.030774','2016-04-12 04:13:41.940926',2,2,''),('FAQ13-Answer','<li>\r\n                                <p>If you take a Lending Stream loan because your finances are tight, an unexpected expense could make it difficult for you to repay your loan. Missed loan payments can result in late fees and additional loan interest charges that can make your loan more expensive than you originally planned.</p>\r\n                                <p> We do everything we can to avoid putting you in this situation by carefully assessing your ability to repay a short-term loan. However, we can\'t anticipate everything about your financial situation when we decide whether or not to approve you for the loan. Carefully consider your ability to repay a loan before you apply. Review the details of the cost of a Lending Stream loan and be certain that you can fit loan payments into your budget. Also consider the possibility that you might run into other unexpected expenses that could make it difficult for you to make loan payments. Read more about <a href=\"#\">How It Works.</a></p>\r\n                            </li>','FAQ13-Answer',1,2,'2016-04-12 01:05:45.810461','2016-04-12 04:01:43.088520','2016-04-12 04:13:35.148764',2,2,''),('FAQ13-Question','What risks should I be aware of when I take out a loan?','FAQ13-Question',1,2,'2016-04-12 01:05:03.737152','2016-04-12 04:01:34.573468','2016-04-12 04:09:27.681603',2,2,''),('FAQ14-Answer','<li>\r\n                                <p>As a responsible lender, we do check your credit file as part of our loan affordability analysis. As one of the top direct online loan providers in the UK, we don\'t make \"bad credit\" loans. However, we do look at more than just your credit when we make our assessment. Our algorithm lets us make a personalised review of your unique situation, not just your credit.</p>\r\n                                <p> Once you fill out our online application, we run the personalised review and provide an instant decision.</p>\r\n                                \r\n                            </li>','FAQ14-Answer',1,2,'2016-04-12 01:06:31.224898','2016-04-12 04:01:24.663659','2016-04-12 04:12:27.560420',2,2,''),('FAQ14-Question','Do you run a credit check and will that impact my credit score?','FAQ14-Question',1,2,'2016-04-12 01:06:08.179258','2016-04-12 04:01:16.278441','2016-04-12 04:12:21.820523',2,2,''),('FAQ15-Answer','<li>\r\n                                <p>For general Lending Stream support, you may contact us by email at info@lendingstream.co.uk or by phone on 0203 365 0133<sup>#</sup>. Our call centre representatives are available 07:00 - 22:00 to assist you.</a>\r\n                                    <p> For information on how to file a complaint, <a href=\"#\">click here.</a> </p>\r\n                                    <p>If you are having difficulty repaying your credit line, or if you won\'t be able to make a payment on time, <a href=\"#\">contact us immediately.</a> We want to help. We will work with you to arrange an affordable alternative payment plan. If you don\'t us know that you are having financial difficulties, we will continue collecting your next payment automatically. That could empty your account of money you need for essential living expenses and send your account into arrears, resulting in a late fee.</p>\r\n                                    <p>The Financial Conduct Authority recommends contacting the following not-for-profit organisations for free, confidential and impartial debt advice, or for details of where to get such advice in your area.</a>\r\n                                        <h5>Money Advice Service</h5>\r\n                                        <p>For free, unbiased and easy-to-access money tools, information and advice, visit www.moneyadviceservice.org.uk or phone 0300 500 5000 to speak to a Money Adviser.</p>\r\n                                        <h5>Money Advice Scotland</h5>\r\n                                        <p>If you live in Scotland, phone 0141 572 0237 or visit www.moneyadvicescotland.org.uk to find contact details for debt advice in your local area.</p>\r\n                                        <h5>Advice NI - Debt Action NI service</h5>\r\n                                        <p>If you live in Northern Ireland, phone 0800 917 4607, email debt@adviceni.net or visit www.debtaction-ni.net for debt advice.</p>\r\n                                        <h5>AdviceUK</h5>\r\n                                        <p>Member centres offer debt advice including specialist advice for minority communities and people with disabilities - visit www.adviceuk.org.uk or phone 0300 777 0107.</p>\r\n                                        <h5>Christians Against Poverty (CAP)</h5>\r\n                                        <p>For free debt advice in your home, check post code coverage at www.capuk.org then call 0800 328 0006.</p>\r\n                                        <h5>Citizens Advice</h5>\r\n                                        <p>For advice and information on debt and other topics, visit your local Citizens Advice Bureau (address in the phone book) or go to www.adviceguide.org.uk.</p>\r\n                                        <h5>National Debtline</h5>\r\n                                        <p>If you live in England, Wales or Scotland phone 0808 808 4000 or visit www.nationaldebtline.org for debt advice and information.</p>\r\n                                        <h5>StepChange Debt Charity</h5>\r\n                                        <p>For debt advice throughout the UK phone 0800 138 1111 or visit www.stepchange.org.</p>\r\n                            </li>','FAQ15-Answer',1,2,'2016-04-12 01:07:13.806786','2016-04-12 04:03:25.190707','2016-04-12 04:12:16.455944',2,2,''),('FAQ15-Question','How can I contact you if I have a problem?','FAQ15-Question',1,2,'2016-04-12 01:06:48.962964','2016-04-12 04:01:04.488862','2016-04-12 04:12:07.604432',2,2,''),('FAQ16-Answer','<li>\r\n                                <p>Your satisfaction is important to us. If you have a concern about our service or performance, we want to hear about it straightaway. Lending Stream complaint specialists are available to help you at <a href=\"mailto:complaints@lendingstream.co.uk\">complaints@lendingstream.co.uk</a> and on 0203 365 0133<sup>#</sup>, 07:00 - 22:00, Monday to Friday. Or you can contact us any time through our <a href=\"#\">Contact Us</a> page.</p>\r\n                                <p>We strive to resolve complaints as quickly as possible. We\'ll acknowledge your complaint within 2 business days of receiving it. It is always our goal to resolve the issue for you as quickly as possible, usually within 8 weeks. If we cannot resolve it within that time period, we will:</p>\r\n                                <ul class=\"ci_faq_subli ci_faq_subli_disc\">\r\n                                    <li>Tell you why we\'re having trouble resolving it.</li>\r\n                                    <li>Keep you updated on the status of your complaint.</li>\r\n                                    <li>Let you know when to expect to hear from us again.</li>\r\n                                </ul>\r\n                                <p>We\'ll respond in writing within 14 days of the original complaint with:</p>\r\n                                <ul class=\"ci_faq_subli ci_faq_subli_disc\">\r\n                                    <li>Our understanding of the situation at hand.</li>\r\n                                    <li>A proposal to resolve the issue.</li>\r\n                                    <li>Options available to you if you\'re not satisfied with our initial response.</li>\r\n                                </ul>\r\n                                <p>If you\'ve gone through our entire complaints process and you\'re still not satisfied with our final response or if you have not received a final response from us within 8 weeks of making your complaint, the Financial Ombudsman Service may be able to help - visit <a href=\"#\">www.financial-ombudsman.org.uk</a> or phone 0300 123 9123<sup>#</sup> or 0800 023 4567<sup>#</sup> FREE.</p>\r\n                                <p>You may also submit a complaint to the European Commission Online Dispute Resolution portal located at <a href=\"http://www.financial-ombudsman.org.uk\">http://ec.europa.eu/consumers/odr/index_en.htm.</a></p>\r\n                                <p>Our full complaints handling procedure can be downloaded <a href=\"#\">here.</a></p>\r\n                            </li>','FAQ16-Answer',1,2,'2016-04-12 01:08:19.244882','2016-04-12 04:00:55.343252','2016-04-12 04:12:00.111087',2,2,''),('FAQ16-Question','How can I register a complaint?','FAQ16-Question',1,2,'2016-04-12 01:07:38.499833','2016-04-12 04:00:47.709468','2016-04-12 04:11:53.304115',2,2,''),('FAQ17-Answer','      <li>\r\n                                <p>Unfortunately, we can\'t guarantee approval of your short-term loan until the very moment that your application is submitted to us for review. Even if you\'ve had a Lending Stream loan before and successfully repaid it, we\'re required to use the latest information available about you in order to make a loan decision. This is meant to ensure that we\'re always using the best available information to reduce the chances of putting you into a position of financial difficulty by approving a loan that you may not be able to repay.</p>\r\n                                <p>The good news is that we offer <a href=\"#\">no-fee loans</a>, which means you won\'t be charged any fees for applying, even if you aren\'t approved.</p>\r\n                                <p>If you just want to get started, you can go straight to our loan application page.</p>\r\n                                <p>You can read about our <a href=\"#\">basic loan requirements</a> to see if you quality for basic eligibility and you can read about our approval process on our <a href=\"#\">How It Works</a> page.If you just want to get started, you can go straight to our loan application page.</p>\r\n                               \r\n                            </li>','FAQ17-Answer',1,2,'2016-04-12 01:09:10.775534','2016-04-12 04:00:41.043986','2016-04-12 04:11:46.098909',2,2,''),('FAQ17-Question','Is there any way to know before I apply if my loan application will be approved?','FAQ17-Question',1,2,'2016-04-12 01:08:40.167056','2016-04-12 04:00:33.007149','2016-04-12 04:11:40.865273',2,2,''),('FAQ18-Answer',' <li>\r\n                                <p>You can update your personal information by logging into your online account. Click on \"My Profile\" to update your information. You can also contact us by email at <a href=\"mailto:info@lendingstream.co.uk\">info@lendingstream.co.uk</a> or by phone on 0203 365 0133<sup>#</sup>. Unfortunately, we do not allow customers to make a change to their first name, last name or birthdate.</p>\r\n                            </li>\r\n                            <li><span>How do I continue my online loan application if I get an error message?</span> <i class=\"fa fa-chevron-right\"></i>\r\n                            </li>\r\n                            <li>\r\n                                <p>\r\n                                    Please contact us at <a href=\"mailto:info@lendingstream.co.uk\">info@lendingstream.co.uk</a> or on the Lending Stream contact number 0203 365 0133<sup>#</sup> and we\'ll be happy to help you. If you can email us a screenshot of the error message it will help us solve the problem you\'re having.\r\n                                </p>\r\n                            </li>','FAQ18-Answer',1,2,'2016-04-12 01:09:55.585297','2016-04-12 04:00:25.193434','2016-04-12 04:11:35.231340',2,2,''),('FAQ18-Question','My information isn\'t accurate. What do I do?','FAQ18-Question',1,2,'2016-04-12 01:09:31.469702','2016-04-12 04:00:17.540360','2016-04-12 04:11:19.443180',2,2,''),('FAQ19-Answer','<li>\r\n                                <p>\r\n                                    You can view the status of your most recent Lending Stream payment and your repayment history in your online account. Once you log in, use the tabs under the \"Active Loans\" section to review the status of your Lending Stream loan(s).\r\n                                </p>\r\n                            </li>\r\n                            <li><span>How long will it take for a payment to be credited to my account?</span><i class=\"fa fa-chevron-right\"></i>\r\n                            </li>\r\n                            <li>\r\n                                <p>The payment is credited to your account immediately, but it may take as long as 24 hours to view the payment details in your Account Section.</p>\r\n                            </li>','FAQ19-Answer',1,2,'2016-04-12 01:10:50.151214','2016-04-12 04:00:10.321177','2016-04-12 04:11:10.928471',2,2,''),('FAQ19-Question','How can I check if my payments are up-to-date?','FAQ19-Question',1,2,'2016-04-12 01:10:24.702108','2016-04-12 04:00:01.083517','2016-04-12 04:11:05.398386',2,2,''),('FAQ2-Answer','<li>\r\n                                <p>To decide how much you can borrow, we use a sophisticated credit scoring system and affordability analysis to assess your ability to repay in a sustainable manner. If you\'ve demonstrated good repayment behavior you can apply for higher loan amounts.</p>\r\n                                <p>Our process is pretty simple, you apply for the loan, we analyze your personalize situation, and if approved you get the money. All the way through the process and once you have a loan with us, we work together for your success.</p>\r\n                                <p>You can read more about that process on our <a href=\"#\">How It Works</a> page or you can get started with our loan application process.</p>                \r\n                            </li>\r\n                            <li><span>How do you make approval decisions?</span> <i class=\"fa fa-chevron-right\"></i>\r\n                            </li>\r\n                            <li>\r\n                                <p>To decide how much you can borrow, we use a sophisticated credit scoring system and affordability analysis to assess your ability to repay in a sustainable manner. If you\'ve demonstrated good repayment behavior you can apply for higher loan amounts.</p>\r\n                                <p>Our process is pretty simple, you apply for the loan, we analyze your personalize situation, and if approved you get the money. All the way through the process and once you have a loan with us, we work together for your success.</p>\r\n                                <p>You can read more about that process on our <a href=\"#\">How It Works</a> page or you can get started with our loan application process.</p>\r\n                               \r\n                            </li>','FAQ2-Answer',1,2,'2016-04-12 00:50:44.992813','2016-04-12 03:59:54.071787','2016-04-12 04:09:48.056204',2,2,''),('FAQ2-Question','Am I eligible to apply for a Lending Stream loan?','FAQ2-Question',1,2,'2016-04-12 00:50:08.124990','2016-04-12 03:59:46.454666','2016-04-12 04:08:09.979794',2,2,''),('FAQ20-Answer',' <li>\r\n                                <p>You can log in to your Lending Stream online account to update your debit card details or to make a one-time payment with a different debit card. You may also call us on 0203 365 0133<sup>#</sup> to change your debit card details permanently. Do not send your debit card details by email, as this risks identity theft.</p>\r\n                            </li>','FAQ20-Answer',1,2,'2016-04-12 01:11:33.215442','2016-04-12 03:59:39.473984','2016-04-12 04:08:17.853745',2,2,''),('FAQ20-Question','How do I change my debit card details?','FAQ20-Question',1,2,'2016-04-12 01:11:10.368760','2016-04-12 03:59:30.518102','2016-04-12 04:08:30.627293',2,2,''),('FAQ21-Answer','<li>\r\n                                <p>You can request a change to your loan repayment dates by logging in to your online account. Under \"My Info\", click on \"Change Pay Dates\" where you\'ll have the option to update the pay frequency for all of your Lending Stream loans, or simply update only your next pay date. You may also email us at <a href=\"mailto:payments@lendingstream.co.uk\">payments@lendingstream.co.uk</a> or call us on 0203 365 0133<sup>#</sup>. Please have the details of your existing pay date handy as well as your new pay date, and a member of our customer care team will be happy to assist you.\r\n                                </p>\r\n                            </li>','FAQ21-Answer',1,2,'2016-04-12 01:12:24.304646','2016-04-12 03:59:23.007908','2016-04-12 04:08:36.100924',2,2,''),('FAQ21-Question','Can I change my loan repayment dates?','FAQ21-Question',1,2,'2016-04-12 01:11:54.981560','2016-04-12 03:59:14.754908','2016-04-12 04:08:41.079624',2,2,''),('FAQ22-Answer','<li>\r\n                                <p>Continuous Payment Authority, or CPA, is permission you give Lending Stream when you apply for a loan to collect your payments automatically from the bank account that\'s linked to your debit card. Most people find it easier and more reliable to set up automatic debit card payments. It can help you avoid missed payments.\r\n                                </p>\r\n                                <p>You have the right to cancel CPA at any time; however, if you do you\'ll need to arrange another way to make payments, such as self-service payments through your online Lending Stream account, a standing bank order, or posting a cheque. If you have an open loan with us, please contact us immediately if you cancel CPA and we\'ll help you arrange another way to make your payments</p>\r\n                            </li>','FAQ22-Answer',1,2,'2016-04-12 01:13:05.908267','2016-04-12 03:59:07.494043','2016-04-12 04:05:20.046356',2,2,''),('FAQ22-Question','How does continuous payment authority work?','FAQ22-Question',1,2,'2016-04-12 01:12:43.574717','2016-04-12 03:58:58.899299','2016-04-12 04:07:33.990174',2,2,''),('FAQ23-Answer','<li>\r\n                                <p>As a responsible lender, we do everything we can to avoid putting you in that situation, by carefully assessing your ability to repay a Lending Stream loan when you apply. However, we understand that your financial situation can unexpectedly change for the worse, making it difficult for you to repay your loan. In that case, we\'ll work with you to arrange an affordable repayment plan.\r\n                                </p>\r\n                                <p>If you are considering whether a Lending Stream loan is right for you, you can read more about <a href=\"#\">How It Works.</a></p>\r\n                                <p>If you have a loan with us and need to talk to us about an affordable repayment plan, <a href=\"#\">contact us.</a> You can also choose to contact free debt advice providers.</p>\r\n                            </li>','FAQ23-Answer',1,2,'2016-04-12 01:13:52.069733','2016-04-12 03:58:49.683618','2016-04-12 04:07:28.706483',2,2,''),('FAQ23-Question','What happens if I can\'t pay back the loan?','FAQ23-Question',1,2,'2016-04-12 01:13:24.282291','2016-04-12 03:58:41.248446','2016-04-12 04:07:23.537929',2,2,''),('FAQ24-Answer','<li>\r\n                                <p>You\'ll find almost everything about your Lending Stream loan in your online account. If your loan status is \"pending\", because you recently applied for a new loan, we may need a bit more information to finalise the information in your account, in which case you can call us on the Lending Stream contact number 0203 365 0133<sup>#</sup>.\r\n                                </p>\r\n                            </li>','FAQ24-Answer',1,2,'2016-04-12 01:14:36.719126','2016-04-12 03:58:33.255278','2016-04-12 04:07:15.206213',2,2,''),('FAQ24-Question','What is the status of my loan?','FAQ24-Question',1,2,'2016-04-12 01:14:16.592722','2016-04-12 03:58:23.697573','2016-04-12 04:07:07.542175',2,2,''),('FAQ25-Answer',' <li>\r\n                                <p>You can check the outstanding balance of your Lending Stream loan(s) by logging in to your online account. Once you log in, use the tabs under the \"Active Loans\" to check the outstanding balance of your loan(s).</p>\r\n                            </li>','FAQ25-Answer',1,2,'2016-04-12 01:15:34.458864','2016-04-12 03:58:16.581067','2016-04-12 04:07:02.040749',2,2,''),('FAQ25-Question','How do I check my outstanding balance?','FAQ25-Question',1,2,'2016-04-12 01:15:05.769355','2016-04-12 03:58:07.185799','2016-04-12 04:06:56.798533',2,2,''),('FAQ26-Answer','li>\r\n                                <p>To decide how much you can borrow, we use a sophisticated credit scoring system and affordability analysis to assess your ability to repay in a sustainable manner. If you\'ve demonstrated good repayment behavior you can apply for higher loan amounts.</p>\r\n                                <p>Our process is pretty simple, you apply for the loan, we analyze your personalize situation, and if approved you get the money. All the way through the process and once you have a loan with us, we work together for your success.</p>\r\n                                <p>You can read more about that process on our <a href=\"#\">How It Works</a> page or you can get started with our loan application process.</p>\r\n                               \r\n                            </li>','FAQ26-Answer',1,2,'2016-04-12 11:04:24.776780','2016-04-12 11:04:24.779189','2016-04-13 05:21:23.857734',2,2,''),('FAQ26-Question','How do you make approval decisions?','FAQ26-Question',1,2,'2016-04-12 11:03:58.519440','2016-04-12 11:03:58.520380','2016-04-12 12:11:50.625650',2,2,''),('FAQ27-Answer',' <li>\r\n                                <p>\r\n                                    Please contact us at <a href=\"mailto:info@lendingstream.co.uk\">info@lendingstream.co.uk</a> or on the Lending Stream contact number 0203 365 0133<sup>#</sup> and we\'ll be happy to help you. If you can email us a screenshot of the error message it will help us solve the problem you\'re having.\r\n                                </p>\r\n                            </li>','FAQ27-Answer',1,2,'2016-04-12 11:05:26.221836','2016-04-12 11:05:26.224086','2016-04-13 05:21:18.985629',2,2,''),('FAQ27-Question','How do I continue my online loan application if I get an error message?','FAQ27-Question',1,2,'2016-04-12 11:04:57.001500','2016-04-12 11:04:57.002929','2016-04-12 12:11:45.082438',2,2,''),('FAQ28-Answer','<li>\r\n                                <p>The payment is credited to your account immediately, but it may take as long as 24 hours to view the payment details in your Account Section.</p>\r\n                            </li>','FAQ28-Answer',1,2,'2016-04-12 11:47:22.385975','2016-04-12 11:47:22.387297','2016-04-13 05:20:52.296075',2,2,''),('FAQ28-Question','How long will it take for a payment to be credited to my account?','FAQ28-Question',1,2,'2016-04-12 11:46:56.091827','2016-04-12 11:46:56.092915','2016-04-13 05:20:38.233209',2,2,''),('FAQ3-Answer','<li>\r\n                                <p>If you do not pay a Repayment Amount when it is due, we will apply the following charges:</p>\r\n                                <ol class=\"ci_faqsubol\">\r\n                                    <li>On the first occasion that a Repayment Amount due is unpaid on the relevant Payment Date, we will apply a default charge of up to &pound;15 and</li>\r\n                                    <li>On any further occasion that a Repayment Amount due is unpaid on the relevant Payment Date, if we did not charge you the full &pound;15 default charge on the first occasion, we will apply a further charge that will result in combined default charges amounting to &pound;15.</li>\r\n                                </ol>\r\n                                <p>Other than that, we offer what is called <a href=\"#\">no-fee loans.</a> This means there is no application fee, no transaction fees, and no early repayment fees. We have no hidden fees at all.</p>\r\n                                <p>If you have a loan with us and would like to see your payment schedule, you can log-in. Or, if you would like to learn more about our loans, go to our <a href=\"#\">How It Works</a> page.</p>\r\n                            </li>','FAQ3-Answer',1,2,'2016-04-12 00:52:13.386274','2016-04-12 03:57:56.101814','2016-04-15 06:18:32.597402',5,2,''),('FAQ3-Question','What loan fees do you charge?','FAQ3-Question',1,2,'2016-04-12 00:51:20.452252','2016-04-12 03:57:47.765282','2016-04-12 04:06:44.643111',2,2,''),('FAQ4-Answer','<li>\r\n                                <p>You can apply for another short-term Lending Stream loan prior to paying off your current loan. From time to time we may even contact you to let you know that you can apply again. However, this doesn\'t mean you\'ll be approved.</p>\r\n                                <p>By law, we can\'t guarantee approval of your short-term loan until the very moment your application is submitted to us for review. Even if you\'ve had a Lending Stream loan before and repaid successfully, we\'re required to use the latest information available about you in order to make a loan decision. This is meant to ensure that we\'re always using the best available information to reduce the chances of putting you into a position of financial difficulty by approving a loan that you may not be able to repay. Additionally, we will not approve an additional loan if requested within a few days of your current pay date.\r\n                                </p>\r\n                                <p>Even if you are in good standing with us, we will not approve more than six total loans with us. You can log in to your account to check on the status of your current loan(s) and apply for an additional loan if eligible.</p>\r\n                                \r\n                            </li>','FAQ4-Answer',1,2,'2016-04-12 00:53:30.361822','2016-04-12 03:57:39.554326','2016-04-12 04:06:38.604747',2,2,''),('FAQ4-Question','Can I get another loan before I have paid off the one I have now?','FAQ4-Question',1,2,'2016-04-12 00:52:48.137801','2016-04-12 03:57:31.134055','2016-04-12 04:06:32.541370',2,2,''),('FAQ5-Answer','<li>\r\n                                <p>Yes, the Lending Stream loan application requires a valid debit card with at least 1 in the account. In our loan agreement you give us permission to use your debit card to collect your loan payments automatically. If at any time you wish to revoke our right to collect payment automatically via your debit card, you may do so by contacting us.</p>\r\n                                <p>If you have a valid debit card, you can begin the application process now. </p>\r\n                               \r\n                            </li>','FAQ5-Answer',1,2,'2016-04-12 00:54:29.150715','2016-04-12 03:57:08.653454','2016-04-12 04:06:23.717390',2,2,''),('FAQ5-Question','Do I need a valid debit card to take out a loan?','FAQ5-Question',1,2,'2016-04-12 00:54:00.463238','2016-04-12 03:57:00.073424','2016-04-12 04:06:14.801056',2,2,''),('FAQ6-Answer','<li>\r\n                                <p>Yes, you need a bank account where we can deposit your funds if your Lending Stream loan is approved.\r\n                                </p>\r\n                                <p>If you have a valid bank account, you can begin the application process now.</p>\r\n                               \r\n                            </li>','FAQ6-Answer',1,2,'2016-04-12 00:55:45.655202','2016-04-12 03:56:52.311010','2016-04-12 04:06:08.837382',2,2,''),('FAQ6-Question','Do I need a valid bank account to get a loan?','FAQ6-Question',1,2,'2016-04-12 00:55:15.749872','2016-04-12 03:56:43.429773','2016-04-12 04:06:00.736294',2,2,''),('FAQ7-Answer','<li>\r\n                                <p>We consider many factors when deciding whether or not to approve your loan request. If information we receive from a credit reference agency is a factor in denying your application, we\'ll let you know the name of the credit reference agency by email, so you can check your credit file with them if you wish. Unfortunately, our Customer Service representatives don\'t have access to why a particular application is declined.</p>\r\n                                <p>You can read more about that process on our <a href=\"#\">How It Works</a> page or you can get started with our loan application process.</P>\r\n                            </li>','FAQ7-Answer',1,2,'2016-04-12 00:56:37.406952','2016-04-12 03:56:37.589766','2016-04-12 04:05:54.303065',2,2,''),('FAQ7-Question','If I\'m not approved for a loan, can I find out why my application was declined?','FAQ7-Question',1,2,'2016-04-12 00:56:13.038295','2016-04-12 03:56:29.486560','2016-04-12 04:05:28.915856',2,2,''),('FAQ8-Answer','<li>\r\n                                <p>We can usually make a decision to approve a Lending Stream short-term loan based on information you give us online; however under certain circumstances, we may ask you to verify some details by phone, email, or fax.</p>\r\n                                <p>You will also need your <a href=\"#\">debit card</a> and a <a href=\"#\">valid bank account.</a></p>\r\n                            </li>','FAQ8-Answer',1,2,'2016-04-12 00:57:41.872500','2016-04-12 03:56:24.847721','2016-04-12 04:04:29.835508',2,2,''),('FAQ8-Question','Will I need to provide any documents with my online loan application?','FAQ8-Question',1,2,'2016-04-12 00:57:10.520072','2016-04-12 03:56:19.672741','2016-04-12 04:04:21.270326',2,2,''),('FAQ9-Answer','<li>\r\n                                <p>We know that many people are looking for a 1-hour loan or even 10-minute loan, so we\'ve streamlined the Lending Stream online loan process to initiate the transfer of cash to your account within 4 minutes* once your application is approved.</p>\r\n                                <p>However, the time that it takes for a cash loan to appear in your account will depend on your bank\'s policies and procedures. If it seems to be taking too long, please check with your bank first. Then contact us at <a href=\"mailto:info@lendingstream.co.uk\">info@lendingstream.co.uk</a> or on 0203 365 0133<sup>#</sup>, 07:00 - 22:00, to check on the status of the transfer.</p>\r\n                                </p> To start the process so you can get the cash you need, just fill out our online application and find out if you are approved.</p>\r\n                               \r\n                                <h4 class=\"ci_pad_top10\">What is a representative example of a Lending Stream loan?</h4>\r\n                                <p>A representative example is a specific way we inform you about the terms of our typical loan and in particular cost of credit in accordance with the Consumer Credit (Advertisements) Regulations 2010.</p>\r\n                                <div class=\"ci_faqpage_table\">\r\n                                    <div class=\"row\">\r\n                                        <div class=\"col-md-6 ci_faq_table_head ci_faq_table_left\">\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-md-12\">Representative example</div>\r\n                                            </div>\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-xs-8\">Annual Interest Rate:</div>\r\n                                                <div class=\"col-xs-4\">292%</div>\r\n                                            </div>\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-xs-8\">Total amount of credit:</div>\r\n                                                <div class=\"col-xs-4\">&pound;200</div>\r\n                                            </div>\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-xs-8\">Representative APR:</div>\r\n                                                <div class=\"col-xs-4\">1272.0%</div>\r\n                                            </div>\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-xs-8\">Duration of agreement:</div>\r\n                                                <div class=\"col-xs-4\">6 months</div>\r\n                                            </div>\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-xs-8\">Total amount payable:</div>\r\n                                                <div class=\"col-xs-4\">&pound;391.68</div>\r\n                                            </div>\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-xs-8\">Total charge of credit:</div>\r\n                                                <div class=\"col-xs-4\">&pound;191.68</div>\r\n                                            </div>\r\n                                        </div>\r\n                                        <div class=\"col-md-6 ci_faq_table_head ci_faq_table_right\">\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-md-12\">Amount of each payment</div>\r\n                                            </div>\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-xs-8\">1<sup>st</sup> repayment:</div>\r\n                                                <div class=\"col-xs-4\">&pound;46.40</div>\r\n                                            </div>\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-xs-8\">2<sup>nd</sup> repayment:</div>\r\n                                                <div class=\"col-xs-4\">&pound;88.00</div>\r\n                                            </div>\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-xs-8\">3<sup>nd</sup> repayment:</div>\r\n                                                <div class=\"col-xs-4\">&pound;78.40</div>\r\n                                            </div>\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-xs-8\">4<sup>th</sup> repayment:</div>\r\n                                                <div class=\"col-xs-4\">&pound;69.76</div>\r\n                                            </div>\r\n                                            <div class=\"row\">\r\n                                                <div class=\"col-xs-8\">5<sup>th</sup> repayment:</div>\r\n                                                <div class=\"col-xs-4\">&pound;59.84</div>\r\n            