d_agreeToTerms\').is(\":checked\")) && (errors == 1)) {\r\n    goToByScroll($(\"#id_agreeToTerms\"));\r\n    }\r\n    else {\r\n    goToByScroll($(\".icon-file-text-alt\"));\r\n    }\r\n    e.preventDefault();\r\n    return;\r\n    }\r\n    show_alert = false;\r\n    e.preventDefault();\r\n    $(\'#btn_next\').prop(\'disabled\', true).addClass(\'disabled\');\r\n    $(\'#security\').modal(\'show\');\r\n    var data = $(\'#landing_form\').serialize();\r\n    $.ajax({\r\n        type: \"POST\",\r\n        data: data,\r\n        dataType: \"json\",\r\n        async: true,\r\n        success: function (data, args) {\r\n            var redirectURL = data.redirectURL;\r\n	    if(redirectURL && !data.card)\r\n            {\r\n                location.href = redirectURL;\r\n            }\r\n            else{\r\n            if (redirectURL) {\r\n                $.ajax({\r\n                    type: \"POST\",\r\n                    data: data,\r\n                    dataType: \'json\',\r\n                    async: true,\r\n                    url: redirectURL,\r\n                    success: function (data, args) {\r\n                        var CardServerRedirectURL = data.redirectURL;\r\n                        var cardServerURL = data.cardServerURL\r\n                        var encoded_leadid = data.encoded_leadid\r\n                        if (data.length != 0 && cardServerURL && encoded_leadid) {\r\n                            $(\'#debitpixel\').attr(\'src\',\"https://\" + cardServerURL + \"/cardinfo/redirect/\" + encoded_leadid + \"/\").load(function(){\r\n                                location.href = CardServerRedirectURL;\r\n                            });\r\n                        } else {\r\n                            location.href = CardServerRedirectURL;\r\n                        }\r\n                    },\r\n                    error: function (error, textStatus, e) {\r\n                        if (error.status == 500) {\r\n                            location.href = \'500.html\';\r\n                        }\r\n                    }\r\n\r\n                });\r\n            } else if (data.status == \'ERROR\') {\r\n                $(\'#security\').modal(\'hide\');\r\n                $.each(data, function (id, val) {\r\n                    if (is_json(val)) {\r\n                        $.each(val, function (id, value) {\r\n                            $(\"#\" + id).parents(\".control-group\").addClass(\"error\").removeClass(\"success\");\r\n                            $(\"#\" + id).parents(\".control-group\").find(\"span.help-block\").text(val[id]);\r\n                            if(id==\'id_Confirm_Loan\')\r\n                                $(\'.inputamounterror\').show();\r\n                            });\r\n                    }\r\n                });\r\n            }\r\n    }        \r\n},\r\n        error: function (error, textStatus, e) {\r\n            if (error.status == 500) {\r\n                location.href = \'500.html\';\r\n            }\r\n        }\r\n    });\r\n','pay frequency landing form submit',1,2,'2016-03-15 18:53:06.893002','2016-03-15 18:53:06.894200','2016-03-15 18:53:11.234144',2,2,''),('PD','Your next payment is due %s','PD',1,2,'2016-05-01 06:57:26.523995','2016-05-01 06:57:26.528828','2016-05-01 07:01:19.234880',2,2,''),('PD-Content','<div class=\"ci_modal_msg\">Your next payment is due on {{overview_details.account_summary.next_due_date}}</div>\r\n<div class=\"ci_modal_return row\">										<div class=\"col-md-4 col-md-offset-4 col-xs-6 col-xs-offset-3\">											<button type=\"button\" class=\"btn ci_btn_green_full\" href=\'/consumer/makepayment/\'>Pay Now</button>								</div>									</div>','PD-Content',1,2,'2016-05-01 06:57:26.523995','2016-05-01 06:57:26.528828','2016-05-01 11:22:32.866292',5,2,''),('PD-Header','PAYMENT DUE','PD-Header',1,2,'2016-05-01 10:42:21.580834','2016-05-01 10:42:21.581828','2016-05-01 10:50:31.928928',2,2,''),('PD-Message-Header','<a href=\'/consumer/ma