INSERT INTO `cmsutils_template` VALUES ('ae','{% load chunks %}\r\n {% load space_filter %}\r\n <!DOCTYPE html>\r\n <HTML>\r\n <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n     \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n     <html>\r\n     <head>\r\n         <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n         <style type=\"text/css\" media=\"all\">\r\n             @page {\r\n             margin: 0.5cm;\r\n             margin-top:1.8cm;\r\n             margin-bottom: 1.8cm;\r\n             @frame footer {\r\n             -pdf-frame-content: footerContent;\r\n             bottom: 0cm;\r\n             margin-left: 0.75cm;\r\n             margin-right: 0.75cm;\r\n             font-size:8px;\r\n             height: 1.5cm;\r\n             }\r\n             }\r\n         </style>\r\n     </head>\r\n     <body>\r\n       <!--html content-->\r\n       <table width=\"100%\">\r\n          <tr>\r\n              <td></td>\r\n              <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n          </tr>\r\n      </table>\r\n      <p align=\"right\">\r\n        Contact Address:<br/>\r\n          <font color=\"SteelBlue\">{% chunk \"lender-name\" %} ,\r\n              <br/>{% chunk \"lender-street1\" %},\r\n              <br/>{% chunk \"lender-street2\" %},\r\n              <br/>{% chunk \"lender-county\" %}, {% chunk \"lender-city\" %},\r\n              <br/>{% chunk \"lender-country\" %}, {% chunk \"lender-postcode\" %}\r\n              <br/>Telephone number: {% chunk \"adeptra-contact\" %}\r\n              <br/>Contact:  {% chunk \"contactus-url\" %}</font>\r\n      </p>\r\n       <table width=\"70%\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n               <tr>\r\n                 <td><p align=\"center\" style=\"font-size:16px;\"><strong>An explanation of your loan</strong></p></td>\r\n               </tr>\r\n             </table>\r\n             {% if product_details.product_type == \"DI\" or  product_details.product_type == \"EXI\" %}\r\n             <p>Before we can process your loan application we need to provide you with an explanation of your loan. Please consider this information carefully alongside the SECCI form provided to help you to decide if this loan is suitable for you.  You can print this information and take it away with you to consider further.</p>\r\n             {% else %}\r\n             <p>Before we can process your loan application we must provide you with some important information known in law as an \'adequate explanation\' about your loan. Please consider this information carefully alongside the SECCI form provided to help you to decide if this loan is suitable for you.</p>\r\n             {% endif %}\r\n             <p><strong>Loan terms and suitability </strong></p>\r\n             <p>{% if product_details.product_type == \"EXI\" or product_details.product_type == \"EXIBiweekly\" %}\r\n     A short term instalment loan of this type is designed to provide you with a cash advance repayable in 24 instalments over approximately 6 months.\r\n          {% endif %}\r\n          {% if product_details.product_type == \"456product\" %}\r\n          A short term  instalment loan of this type is designed to provide you with a cash advance repayable in 6 scheduled instalments over approximately 6 months. We offer loans of up to &pound;1500.00. The total cost of credit is interest charged at {{product_details.interest_rate}}% of the capital balance outstanding (or &pound;{{product_details.interest_rate|floatformat:2}} per &pound;100.00 outstanding) per payment cycle. A payment cycle will usually be the period of one month, being the period between your paydays, but the first payment cycle may be shorter or longer than a month as it will run from the date you take out the loan until your next payday, or, if your next payday is within 8 days of the date you take out the loan, to the payday afterwards. The precise  duration of your proposed loan in days and the length of each payment cycle is shown below under \'The cost of your loan\'. Interest is calculated and applied to the capital balance  outstanding at the beginning of each payment cycle.\r\n          {% else %}\r\n             {% if product_details.product_type == \"DI\" %}\r\n             This is a short term instalment loan which is repayable in 6 instalments over approximately 6 months.</p>\r\n             <p>Short term lending of this type is an expensive form of credit which is not suitable for supporting sustained borrowing over longer periods.  Short term loans are also not suitable for paying off your other outstanding loans.</p>\r\n         <p>You cannot roll-over this loan or take out a further loan from us to refinance this loan.</p>\r\n         <p>Subject to eligibility, you may apply for or we may contact you and invite you to apply for a further top-up loan from us. If you do apply and are accepted for a top-up loan, it will be a separate loan and in addition to any existing loan(s) you currently have with us, and as a result you will be increasing your total amount of debt with us.</p>\r\n         {% endif %}\r\n          {% endif %}\r\n {% if product_details.product_type != \"DI\" %}\r\n </p><p>Short term lending of this type is an expensive form of credit which is unsuitable for supporting sustained borrowing over longer periods, and would be expensive as a means of longer term borrowing. Short term loans are not suitable for paying off your other outstanding loans.</p>\r\n <p>You cannot roll-over this loan or take out a further loan from us to refinance this loan.</p>\r\n <p>Subject to eligibility, you may apply for or we may contact you and invite you to apply for a further top-up loan from us. If you do apply and are accepted for a top-up loan, it will be a separate loan and in addition to any existing loan(s) you currently have with us, and as a result you will be increasing your total amount of debt with us.</p>\r\n {% endif %}\r\n             <p><strong>The cost of your loan </strong></p>\r\n             <p>{% if product_details.product_type == \"EXI\" or product_details.product_type == \"EXIBiweekly\" %}\r\n You have requested a loan for &pound;{{confirmed_amount|floatformat:2}} over\r\n {{loanterm_indays}} days. If you take out this loan, you will\r\n         have to pay weekly instalments which will vary each week and, if you\r\n         keep to the terms of the loan, you will repay a total of\r\n         {{total_repayment|floatformat:2}}. Details of the weekly payments you will have t\r\n         o pay are as follows: <br/><br/>\r\n          {% endif %}\r\n            {% if product_details.product_type == \"456product\" %}\r\n            You have requested a loan for &pound;{{confirmed_amount|floatformat:2}} over {{loanterm_indays}} days for which the total interest charge  is &pound;{{total_term_interest|floatformat:2}} if you repay on time. You  will repay a total of &pound;{{total_repayment|floatformat:2}} comprising the amount you borrowed and the credit charges on the repayment dates scheduled below. However, you may settle this loan early in full or in part at any time prior to the final payment date by paying the full amount due less any rebate due under the Consumer Credit Act 1974.</p>\r\n            <p>If you repay your loan early and in full during a cycle, you will incur interest for the entirety of the cycle during which you make early repayment, but you will not be charged interest for what would have been the remainder of the loan term. Thus, early repayment of your loan in full prior to the start of the final cycle will result in savings on interest that otherwise would have been owed.</p>\r\n            {% else %}\r\n               {% if product_details.product_type == \"DI\" %}\r\n               You have requested a loan for &pound;{{confirmed_amount|floatformat:2}} over {{loanterm_indays}} days.  If you take out this loan, you will have to pay monthly instalments which will vary each month and, if you keep to the terms of the loan, you will repay a total of &pound;{{total_repayment|floatformat:2}}.  Details of the monthly payments you will have to pay are as follows:</p>\r\n               {% endif %}\r\n          {% endif %}\r\n \r\n <table width=\"100%\" border=\"1\" cellspacing=\"0\" cellpadding=\"5\" style=\"font-size:12px\">\r\n     {% if product_details.product_type == \"DI\" %}\r\n               <tr>\r\n                 <td style=\"background:#e6e6fa;\" align=\"center\" width=\"50%\">Payment Date(s)</td>\r\n                 <td style=\"background:#e6e6fa;\" align=\"center\" width=\"50%\">Amount Repayable</td>\r\n               </tr>\r\n         {% else %}\r\n             <tr>\r\n                 <td style=\"background:#e6e6fa;\" align=\"center\" width=\"25%\">Payment Date(s)</td>\r\n                 <td style=\"background:#e6e6fa;\" align=\"center\" width=\"19%\">Amount Repayable (Principal Due+Interest Due)</td>\r\n                 <td style=\"background:#e6e6fa;\" align=\"center\" width=\"19%\">Principal Due</td>\r\n                 <td style=\"background:#e6e6fa;\" align=\"center\" width=\"18%\">Interest Due</td>\r\n                 <td style=\"background:#e6e6fa;\" align=\"center\" width=\"19%\">Payment Cycle Period (days)</td>\r\n               </tr>\r\n         {% endif %}\r\n     {% for sub in payment_schedule %}\r\n                         <tr>\r\n                         <td align=\"center\">{{ sub.paymentdate|date_formatter}}</td>\r\n                         {% ifequal sub.principal 0 %}\r\n                         <td align=\"center\">&pound;{{ sub.principal|addf:sub.interest }}</td>\r\n                           {%if product_details.product_type != \"DI\" %}\r\n                           <td align=\"center\">&pound;{{ sub.principal|floatformat:2 }}</td>\r\n                           <td align=\"center\">&pound;{{ sub.interest|floatformat:2 }}</td>\r\n                           {% endif %}\r\n                         {% else %}\r\n                         <td align=\"center\">&pound;{{ sub.principal|addf:sub.interest }}</td>\r\n                           {%if product_details.product_type != \"DI\" %}\r\n                           <td align=\"center\">&pound;{{ sub.principal|floatformat:2 }}</td>\r\n                           <td align=\"center\">&pound;{{ sub.interest|floatformat:2 }}</td>\r\n                           {% endif %}\r\n                         {% endifequal %}\r\n                         {%if product_details.product_type != \"DI\" %}\r\n                   <td align=\"center\">{{cycle_period|lookup_list:forloop.counter0}}</td>\r\n                         {% endif %}\r\n       </tr>\r\n                  {% endfor %}\r\n   </table>\r\n           <br/>\r\n           {% if product_details.product_type == \"DI\" or product_details.product_type == \"EXI\" %}\r\n           <p><strong>Continuous payment authority (CPA)</strong></p>\r\n           <p><i>What is it and how does it work?</i></p>\r\n           <p>A CPA is an authority that you give us to collect the instalments you have agreed to pay under your loan directly from your bank or building society account using the debit card details you have provided for this purpose. You must inform us immediately of any changes to your bank details.</p>\r\n           <p>You authorise us to verify your debit card by freezing a sum of not more than &pound;1, for a reasonable period of time not exceeding 5 days. The frozen amount will be released after such time.</p>\r\n           <p><i>How and when will the CPA be applied?</i></p>\r\n           <p>We will use your CPA to collect the instalments automatically from your bank or building society account on each payment date.  We will not collect instalments or attempt to collect instalments from you under your CPA on any other dates without your express consent.  We will also not use your CPA to collect a partial payment (i.e. a sum which is less than the full instalment amount plus any arrears, associated default charges and interest) unless:<p>\r\n     <ul>\r\n     <li>we are willing to accept such less sum; and</li>\r\n     <li>you have expressly agreed that we can collect a partial payment.</li>\r\n     </ul>\r\n     <p><i>What happens if I do not have sufficient funds in my account?</i></p>\r\n     <p>If our first attempt to recover an instalment is unsuccessful, then we may make a further attempt one day later.  If we are unsuccessful in recovering an instalment, we will stop attempting to collect payment under your CPA at that point and we will try to contact you by phone, email and/or text message to find out the reason for this.  We will seek either to obtain your consent to restart the CPA, or to arrange an alternative repayment plan if warranted.</p>\r\n     <p>If we are unable to contact you before your next instalment is due, and, after reviewing the information we have about you, we conclude that there is no further evidence of financial difficulty, we will use the card details you have given us to collect the next instalment (plus your arrears, and any associated default charges and interest) under your existing CPA.  If, however, we suspect that you are in financial difficulty, we will not try to collect the next instalment.</p>\r\n     <p><i>What if I am having repayment difficulties? </i></p>\r\n     <p>We urge you to contact us as soon as possible to discuss any repayment difficulties and avoid incurring unnecessary charges. If you are experiencing financial hardship we will show forbearance and work with you to agree an alternative resolution.  The sooner you contact us the sooner we can make alternative repayment arrangements and minimise your default costs.</p>\r\n     <p>If we decide to allow you to follow an alternative repayment plan, we will obtain your consent before we continue to use CPA in connection with the repayment plan.</p>\r\n     <p></p>\r\n     <p><i>What if I can\'t pay? </i></p>\r\n     <p>If we come to the conclusion that we are not going to be able to collect your debt at all, we may decide to assign it to a debt collection agency in which case we shall send you a notice of assignment.</p>\r\n     <p><i>Do I have to provide a CPA?  </i></p>\r\n     <p>Although we ask all customers to set up a CPA when taking out a loan from us, you can cancel your CPA with respect to any or all future instalments. You can do this by contacting your bank directly or by calling us no later than the close of business on the day prior to collection at 0203 365 0133. If you cancel your CPA, you must arrange to pay the instalments by the relevant due dates by other means.  Alternative ways to pay us include:</p>\r\n     <ul>\r\n     <li>logging on to our website at <a href=\"http://www.lendingstream.co.uk\" target=\"_blank\">www.lendingstream.co.uk</a> or</li>\r\n     <li>telephoning us on 0203 365 0133.</li>\r\n     </ul>\r\n           <p><i>How can I cancel my CPA? </i></p>\r\n     <p>You can cancel your CPA with respect to any or all future instalments. You can do this by contacting your bank directly or by calling us no later than the close of business on the day prior to collection at 0203 365 0133. Again, if you cancel your CPA, you must arrange to pay your instalment by other means, and this must reach us by the relevant payment due date.</p>\r\n           <p><strong>Consequences of default</strong></p>\r\n           {% if product_details.product_type == \"DI\" %}\r\n           <p>On the first occasion that we are unable to collect your due amount, we will apply a default charge of up to &pound;15.  On any further occasion, if we did not charge you the full &pound;15 default charge on the first occasion, we will apply a further charge that will result in combined default charges amounting to &pound;15</p>\r\n         {% endif %}\r\n         {% if product_details.product_type == \"EXI\" %}\r\n         <p>On the each occasion that we are unable to collect your due amount, we will apply a default charge of up to &pound;5. So long as the combined default charges do not exceed &pound;15</p>\r\n         {% endif %}\r\n           <p>You may also be required to pay us interest on principal sums in arrears at the contractual rate set out in your SECCI.  However, you will never have to pay back in total more than twice your loan amount.</p>\r\n           <p>Missing payments will require you to pay more than the amounts set out in your agreement, which means that the total cost of your debt will grow. If you don\'t make your payments on time we may record this at Credit Reference Agencies and this may make obtaining credit more difficult and more expensive in the future. If you become insolvent this will remain on your file for 6 years. Missing payments could also result in legal action being taken against you (including a charging order being sought over your home), which could result in a court order being obtained and you incurring legal costs. If a court order secures any outstanding debt against your home, this could lead to your home being repossessed.</p>\r\n           <p><strong>Your right of withdrawal </strong></p>\r\n           <p>You have the right to withdraw from the agreement for a period of 14 days beginning with the day after the day on which you receive a copy of the executed Loan Agreement. You can exercise this right by writing to us at Lending Stream, Wisteria Grange Barn, Pikes End, Pinner, London, United Kingdom, HA5 2EX, or calling us on 0203 365 0133 or contacting us at {% chunk \"contactus-url\" %}, clearly stating your intention to withdraw. Unless you make a specific request to withdraw from the loan agreement, early repayments made within the withdraw period shall not be treated as a withdrawal. If you withdraw you must return any monies paid to you within 30 days after the date you withdraw and pay interest accrued from the date you are given the money to the date you repay us.</p>\r\n <p><strong>Who to ask for further information </strong></p>\r\n           <p>Please contact us via the number 0203 365 0133, postal or email address given above if you have any  questions or would like further information or clarification about our Agreements. You can also visit our website<a href=\"http://www.lendingstream.co.uk/\" target=\"_blank\"> www.lendingstream.co.uk </a>for further information.</p>\r\n <p>There are many  other organisations offering advice but be aware that some may charge for their  services. The ones listed below all offer free advice:</p>\r\n           <p><strong>Citizens Advice Bureau </strong>- a network of local offices offering free, confidential independent advice.<a href=\"http://www.citizensadvice.org.uk/\" target=\"_blank\">www.citizensadvice.org.uk </a>(England,  Wales and Northern Ireland), or <a href=\"http://www.cas.org.uk/\" target=\"_blank\">www.cas.org.uk </a>(Scotland)</p>\r\n           <p><strong>Consumer Credit Counselling Service </strong>- free, confidential advice and support - <a href=\"http://www.cccs.co.uk/\" target=\"_blank\">www.cccs.co.uk </a>or tel 0800  138 1111</p>\r\n           <p><strong>National Debtline </strong>- a free, confidential and independent telephone helpline for debt problems. <a href=\"http://www.nationaldebtline.co.uk/\" target=\"_blank\">www.nationaldebtline.co.uk </a>or  tel 0808 808 4000 (England, Wales, and Scotland)</p>\r\n           <p><strong>Money Advice Service </strong>- <a href=\"http://www.moneyadviceservice.org.uk/\" target=\"_blank\">www.moneyadviceservice.org.uk </a>or  tel 0300 500 5000 </p></td>\r\n           {% else %}\r\n           <p>The credit amount will be transferred to your nominated bank account free of charge through the Faster Payments Service (FPS) if supported by your bank.</p>\r\n           <p><strong>Repayments and continuous payment authority</strong></p>\r\n           <p>Any and all repayments that you make will be first applied to any outstanding charges, then to the interest accrued and finally to the outstanding capital balance of your loan. </p>\r\n <p>When you take out the loan you provide us with a continuous payment authority (CPA) so that we can collect repayments automatically from your bank account using the debit card you nominate for this purpose.</p>\r\n           <p>We will collect the repayments due, including any applicable charges and arrears, on the dates set out above using the debit card details you provide. As used herein, the due amount means interest, principal, fees and arrears due on or prior to any Payment Date and not previously paid.</p>\r\n           <p>If the first attempt to recover the due amount on the due date is unsuccessful, then we may make one further attempt one day after the due  date. Both attempts made will be for the due amount (as specified above).  If we are not able to collect payment of the due amount after two collection attempts, we will not make any further attempts to collect payment using CPA without your consent.</p>\r\n           <p>Where the due amount cannot be obtained on a date set out above, we will make prompt attempts on that day and the following days to contact you by phone, email and/or text message to find out why repayment was unsuccessful and arrange an alternative repayment plan if warranted. We urge you to communicate with us if you cannot meet your repayment obligations; we will show forbearance if you are experiencing financial hardship. The sooner you contact us the sooner we can make alternative repayment arrangements and minimise your default costs.  If we agree to an alternative repayment plan with you, we will obtain your consent before we continue to use CPA in accordance with such alternative repayment plan.</p>\r\n           <p>We will only ever attempt to collect the due amount outstanding, unless we accept an offer of payment from you which is less that the total amount outstanding and you consent to the part payment collection.</p>\r\n           <p>The above processes as laid down above will be followed until we decide to assign your debt to a debt collection agency in which case we shall send you a notice of assignment; or up to 60 days after the last payment date of the Loan Agreement has passed, whichever is earlier.</p>\r\n           <p>You have the right to cancel your previously authorised CPA with respect to any payment that has not yet been deducted from your account. You may do so by contacting your bank directly or by calling us no later than the close of business on the day prior to collection at 0203 365 0133 and informing us that you revoke such authority. Revoking such payment authority does not relieve you of your obligations with respect to amounts due under the loan agreement. If you revoke your previously authorised payment authority, you will need to provide an alternative method of repayment on the Payment Date to avoid going into default.</p>\r\n           <p><strong>Consequences of default</strong></p>\r\n           <p>On the each occasion that we are unable to collect your due amount, we will apply a default charge of up to &pound;5, so long as the combined default charges do not exceed &pound;15.</p>\r\n           <p>You may also be required to pay us interest on sums in arrears at the contractual interest rate  provided herein; provided, that you will not be liable to pay such interest  charges in respect of periods beyond the 60th day after the final Payment Date.</p>\r\n           <p>Missing payments will require you to pay more than the amounts set out in your agreement, which means that the total cost of your debt will grow.  If you don\'t make your payments on time we may record this at Credit Reference Agencies and this may make obtaining credit more difficult and more expensive in the future. If you become insolvent this will remain on your file for 6 years. Missing payments could also result in legal action being taken against you, which could result in a court order being obtained and you incurring legal costs.  If a court order secures any outstanding debt against your home, this could lead to your home being repossessed.</p>\r\n           <p><strong>Your right of withdrawal </strong></p>\r\n           <p>You have the right to withdraw from the agreement for a period of 14 days beginning with the day after the day on which you receive a copy of the executed Loan Agreement. You can exercise this right by writing to us at Lending Stream, Wisteria Grange Barn, Pikes End, Pinner, London, United Kingdom, HA5 2EX, or calling us on 0203 365 0133 or contacting us at {% chunk \"contactus-url\" %}, clearly stating your intention to withdraw. Unless you make a specific request to withdraw from the loan agreement, early repayments made within the withdraw period shall not be  treated as a withdrawal. If you withdraw you must return any monies paid to you within 30 days after the date you withdraw and pay interest accrued from the  date you are given the money to the date you repay us.</p>\r\n <p><strong>Who to ask for further information </strong></p>\r\n           <p>Please contact us via the number, postal or email address given above if you have any  questions or would like further information or clarification about our Agreements. You can also visit our website<a href=\"http://www.lendingstream.co.uk/\" target=\"_blank\"> www.lendingstream.co.uk </a>for further information.</p>\r\n <p>There are many  other organisations offering advice but be aware that some may charge for their  services. The ones listed below all offer free advice:</p>\r\n           <p><strong>Citizens Advice Bureau </strong>- a network of local offices offering free, confidential independent advice.<a href=\"http://www.citizensadvice.org.uk/\" target=\"_blank\">www.citizensadvice.org.uk </a>(England,  Wales and Northern Ireland), or <a href=\"http://www.cas.org.uk/\" target=\"_blank\">www.cas.org.uk </a>(Scotland)</p>\r\n           <p><strong>Consumer Credit Counselling Service </strong>- free, confidential advice and support - <a href=\"http://www.cccs.co.uk/\" target=\"_blank\">www.cccs.co.uk </a>or tel 0800  138 1111</p>\r\n           <p><strong>National Debtline </strong>- a free, confidential and independent telephone helpline for debt problems. <a href=\"http://www.nationaldebtline.co.uk/\" target=\"_blank\">www.nationaldebtline.co.uk </a>or  tel 0808 808 4000 (England, Wales, and Scotland)</p>\r\n           <p><strong>Money Advice Service </strong>- <a href=\"http://www.moneyadviceservice.org.uk/\" target=\"_blank\">www.moneyadviceservice.org.uk </a>or  tel 0300 500 5000 </p></td>\r\n           {% endif %}\r\n         </tr>\r\n       </table>\r\n   <div id=\"footerContent\">\r\n               <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n               Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br />\r\n               Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n         </div>\r\n     </div>\r\n \r\n </body>\r\n </html>','ae',1,1,'2016-06-07 18:01:19.504186','2016-06-07 18:01:19.505324','2017-12-08 09:28:58.000000',1,2,''),('agreement','{% load chunks %}\r\n {% load space_filter %}\r\n <!DOCTYPE HTML>\r\n <HTML>\r\n <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n     \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n     <html>\r\n     <head>\r\n         <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n         <style type=\"text/css\" media=\"all\">\r\n             @page {\r\n             margin: 0.5cm;\r\n             margin-top:1.8cm;\r\n             margin-bottom: 1.8cm;\r\n             @frame footer {\r\n             -pdf-frame-content: footerContent;\r\n             bottom: 0cm;\r\n             margin-left: 0.75cm;\r\n             margin-right: 0.75cm;\r\n             font-size:8px;\r\n             height: 1.5cm;\r\n             }\r\n             }\r\n         </style>\r\n     </head>\r\n     <body>\r\n       <!--html content-->\r\n       <table width=\"100%\">\r\n          <tr>\r\n              <td></td>\r\n              <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n          </tr>\r\n      </table>\r\n      <p>\r\n        Contact Address:<br/>\r\n             {% chunk \"lender-name\" %} ,\r\n              <br/>{% chunk \"lender-street1\" %},\r\n              <br/>{% chunk \"lender-street2\" %},\r\n              <br/>{% chunk \"lender-county\" %}, {% chunk \"lender-city\" %},\r\n              <br/>{% chunk \"lender-country\" %}, {% chunk \"lender-postcode\" %}\r\n              <br/>Telephone number: {% chunk \"LsAcctSectionNumber\" %}\r\n              <br/>Contact:  {% chunk \"contactus-url\" %}\r\n      </p>\r\n \r\n <p>Application Id: <u>{{id}}</u></p>\r\n  <p><b>Fixed Sum Loan Agreement regulated by the Consumer Credit Act 1974</b></p>\r\n  <p>This Loan Agreement is made between:</p>\r\n  <p>{% chunk \"new-lender-name\" %}, whose correspondence address is {% chunk \"contact-address-single-line\" %} (the &quot;Creditor, we, us, our&quot;) and</p>\r\n  <p>{{title|title}}.\r\n   {{first_name}} {% if last_name %}{{last_name}}{%endif%},\r\n   {{address}}\r\n   (the &quot;Debtor, you, your&quot;).</p>\r\n  <p><u>Duration of the Loan Agreement</u>: {{loanterm_indays}} days, commencing on the day we sign this Loan Agreement.</p>\r\n  <p><u>Amount of Credit</u>: &pound;{{confirmed_amount|floatformat:2}}</p>\r\n  <p><u>How and when credit will be provided</u>: We will provide you with the Amount of Credit once you have signed this Loan Agreement and we have verified your debit card and bank details.  We will do this by paying the Amount of Credit into the bank account specified by you.  Transfer of your funds is free of charge and will be made through the Faster Payments Service (FPS) if supported by your bank. </p>\r\n  <p><u>Interest</u>: Interest is charged for the Duration of the Loan Agreement at the fixed flat rate of {{product_details.interest_rate|floatformat:2 }}% of the capital balance outstanding (or &pound;{{product_details.interest_rate|floatformat:2 }} per &pound;100.00 outstanding) per day equating to {{flatrate_perannum|floatformat:2}}% per annum. Interest is calculated and applied to the capital balance outstanding at the beginning of each day.</p>\r\n  <p><u>The Total Amount Payable</u>: &pound;{{total_repayment|floatformat:2 }}. This is the sum of the Amount of Credit &pound;{{confirmed_amount|floatformat:2}} and our total charge for the credit of &pound;{{total_term_interest|floatformat:2 }} (comprising interest only) under this Loan Agreement.</p>\r\n  <p><u>APR</u>: {{apr|floatformat:1 }}%. The APR is calculated on the assumption that both parties comply with the terms of the Loan Agreement; i.e. you borrow the Amount of Credit over the Duration of the Loan Agreement and repay it as set out below.</p>\r\n <p><u>Timing and amount of Repayments</u>: The Total Amount Payable is to be repaid over {{no_of_cycles}} instalments on the Payment Dates and in the Repayment Amounts shown in the Repayment Schedule below:</p>\r\n  <div class=\"esigntab\">\r\n  <table width=\"100%\" border=\"1\" cellspacing=\"0\" cellpadding=\"5\">\r\n  <tr>\r\n  <td style=\"background:#e6e6fa;\" align=\"center\" width=\"20%\"><p>Payment Date(s)</p></td>\r\n  <td style=\"background:#e6e6fa;\" align=\"center\" width=\"40%\"><p>Repayment Amount (Principal Due+Interest Due)</p></td>\r\n  <td style=\"background:#e6e6fa;\" align=\"center\" width=\"20%\"><p>Principal Due</p></td>\r\n  <td style=\"background:#e6e6fa;\" align=\"center\" width=\"20%\"><p>Interest Due</p></td>\r\n  </tr>\r\n  {% for agreement in payment_schedule %}\r\n  <tr>\r\n  <td align=\"center\"><p>{{agreement.paymentdate|date_formatter}}</p></td>\r\n  <td align=\"center\"><p>&pound;{{agreement.principal|addf:agreement.interest}}</p></td>\r\n  <td align=\"center\"><p>&pound;{{agreement.principal|floatformat:2}}</p></td>\r\n  <td align=\"center\"><p>&pound;{{agreement.interest|floatformat:2}}</p></td>\r\n  </tr>\r\n  {% endfor %}\r\n  </table>\r\n  </div>\r\n  <p>&nbsp;</p>\r\n  <p><u>Before you sign this Loan Agreement please read the following</u>:</p>\r\n  <p>This Agreement is entered into on the understanding that you are over the age of 18 and the information you have provided us is true and accurate.  You must inform us immediately of any changes to your bank details or employment details, or of any other changes in circumstances which may affect your ability to make payments under this Loan Agreement.</p>\r\n  <p>The Terms and Conditions and the &quot;How we use your information&quot; details set out below are part of this Loan Agreement; please read them carefully.</p>\r\n  <p><u>Signature</u>:</p>\r\n  <p>This is a Credit Agreement regulated by the Consumer Credit Act 1974. Sign it only if you want to be bound by its terms.</p>\r\n  <p>Signature(s) of Debtor(s): {{first_name}} {{last_name}}</p>\r\n  <p>Date(s) of Signature(s): {{csigned_date|date_formatter}}</p>\r\n  <p>Signed for (or on behalf of) Creditor:{% if lender_name %}{% chunk \"new-lender-name\" %}{%endif%}</p>\r\n  <p>Date(s) of Signature(s):{% if Date_of_Signature %}{{Date_of_Signature|date_formatter}}{%endif%}</p>\r\n  <p>&nbsp;</p>\r\n  <pagebreak>\r\n <h4><p align=\"center\"><strong>TERMS AND CONDITIONS</strong></p></h4>\r\n <ul class=\"terms-list\" style=\"list-style:none\">\r\n  <li><p>1. <u>Right to vary if there is a delay in providing you with the Amount of Credit:</u></p></li>\r\n  <li><p>1.1 If there is a delay in providing the Amount of Credit (for example if it takes longer than we expected to verify your debit card and bank details before signing the Loan Agreement) we reserve the right to make the following variations to the Loan Agreement:</p></li>\r\n  <ul style=\"list-style:none;\">\r\n   <li><p>(a) a variation to the Duration of the Loan Agreement;</p></li>\r\n   <li><p>(b) if the delay results in your first Payment Date under this Loan Agreement being fewer than 14 days after we provide you with the Amount of Credit, a variation to your Repayment Schedule to make your first Payment Date later;</p></li>\r\n   <li><p>(c) a variation to the APR as a result of 1) and/or 2) above; and</p></li>\r\n   <li><p>(d) if the delay results in an extension to the Duration of the Loan Agreement, a variation to the Total Amount Payable.</p></li>\r\n  </ul>\r\n  <li><p>1.2 If we vary your Loan Agreement, we will notify you in writing before the change takes effect.</p></li>\r\n  <li><p>2. <u>Statement of account</u>:</p></li>\r\n  <li><p>2.1 You have the right to receive, on request, and free of charge, at any time throughout the duration of the Loan Agreement pursuant to section 77B of the Consumer Credit Act 1974, a statement (in the form of a table) showing:</p> </li>\r\n  <ul style=\"list-style:none;\">\r\n   <li><p>(a) the details of each instalment owing under this Loan Agreement;</p></li>\r\n  <li><p>(b) the date on which each instalment is due, the amount and any conditions relating to the payment of the instalment; and</p></li>\r\n   <li><p>(c) a breakdown of each instalment showing how much comprises: </p></li>\r\n   <ul style=\"list-style:none;\">\r\n    <li><p>(i)capital repayment;</p></li>\r\n    <li><p>(ii)interest payment; and</p></li>\r\n    <li><p>(iii)if applicable, any other charges.</p></li>\r\n   </ul>\r\n   </ul>\r\n  <li><p>3. <u>Continuous payment authority (<b>CPA</b>)</u>:</p></li>\r\n  <li><p>3.1  You must inform us immediately of any changes to the bank account and debit card details that relate to your CPA.</p></li>\r\n  <li><p>3.2 You authorise us to verify your debit card by freezing a sum of not more than &pound;1, for a reasonable period of time not exceeding 5 days. The frozen amount will be released after such time.</p></li>\r\n  <li><p>3.3 We will use your CPA to collect the Repayment Amounts (see above) automatically from your bank account on the Payment Dates (see above).  We will not collect payments or attempt to collect payments from you under your CPA on any other dates without your express consent.  We will also not use your CPA to collect a partial payment (i.e. a sum which is less than the full Repayment Amount plus any arrears, associated default charges and interest) unless:</p></li>\r\n <ul style=\"list-style:none;\">\r\n   <li><p>(a) we are willing to accept such less sum; and</p></li>\r\n   <li><p>(b) you have expressly agreed that we can collect a partial payment.  All payments will be applied first to default charges, then interest and then to the Loan Amount.</p></li>\r\n  </ul>\r\n  <li><p>3.4 If our first attempt to recover a Repayment Amount on the Payment Date is unsuccessful, then we may make a further attempt one day after the Payment Date.   If we are unsuccessful in recovering a Repayment Amount after two attempts, we will stop attempting to collect payment under your CPA at that point and we will try to contact you by phone, email and/or text message to find out the reason for this.  We will seek either to obtain your consent to restart the CPA, or to arrange an alternative repayment plan if warranted. </p></li>\r\n  <li><p>3.5 If we are unable to contact you before the next Payment Date, and, after reviewing the information we have about you, we conclude that there is no further evidence of financial difficulty, we will use the card details you have given us to collect the next Repayment Amount (plus any arrears, associated default charges and interest) under your existing CPA.  If, however, we suspect that you are in financial difficulty, we will not try to collect the next instalment.</p></li>\r\n  <li><p>3.6  We urge you to contact us as soon as possible to discuss any repayment difficulties and avoid incurring unnecessary charges. If you are experiencing financial hardship we will show forbearance and work with you to agree an alternative resolution.  The sooner you contact us the sooner we can make alternative repayment arrangements and minimise your default costs. </p></li>\r\n  <li><p>3.7 If we decide to allow you to follow an alternative repayment plan, we will obtain your consent before we continue to use your CPA in connection with the repayment plan.</p></li>\r\n  <li><p>3.8  If we come to the conclusion that we are not going to be able to collect your debt at all, we may decide to assign it to a debt collection agency in which case we shall send you a notice of assignment.</p></li>\r\n  <li><p>3.9 Although we ask all customers to set up a CPA when entering into a Loan Agreement with us, you can cancel your CPA with respect to any or all Repayment(s) that have not yet been collected from your account. You can do this by contacting your bank directly or by calling us no later than the close of business on the day prior to collection at {% chunk \"LsAcctSectionNumber\" %}. If you cancel your CPA, you must arrange to meet your Repayment(s) by other means, and any such Repayment(s) must reach us by the relevant Payment Date(s).  Alternative ways to pay us include:</p></li>\r\n   <ol style=\"list-style:none;\">\r\n   <li><p>&#8226; logging on to our website at <a href =\'http://www.lendingstream.co.uk\' target=\'_blank\'>www.lendingstream.co.uk</a> and or </p></li>\r\n   <li><p>&#8226; telephoning us on {% chunk \"LsAcctSectionNumber\" %}.</p></li>\r\n  </ol>\r\n  <li><p>3.10  You can cancel your CPA with respect to any or all Repayments that have not yet been collected from your account. You can do this by contacting your bank directly or by calling us no later than the close of business on the day prior to collection at {% chunk \"LsAcctSectionNumber\" %}. If you cancel your CPA, you must arrange to meet your Repayment by other means, and this must reach us by the relevant Payment Date.</p></li>\r\n  <li><p>4 <u>Charges and interest payable if you are in default</u>:</p></li>\r\n  <li><p>4.1  If you do not pay a Repayment Amount when it is due, we will apply the following charges:</p></li>\r\n  <ul style=\"list-style:none;\">\r\n   <li><p>(a) on the first occasion that a Repayment Amount due is unpaid on the relevant Payment Date, we will apply a default charge of up to &pound;15; and</p></li>\r\n   <li><p>(b) on any further occasion that a Repayment Amount due is unpaid on the relevant Payment Date,  if we did not charge you the full &pound;15 default charge on the first occasion, we will apply a further charge that will result in combined default charges amounting to &pound;15.</p></li>\r\n  </ul>\r\n  <li><p>4.2 You may also be required to pay us interest on principal sums in arrears at the contractual interest rate set out in your Loan Agreement; provided, that you will not be liable to pay such interest charges in respect of periods beyond the 60th day after the final Payment Date. </p></li>\r\n  <li><p>4.3 If you fail to repay us on time, you will never have to pay back in total more than twice the Amount of Credit (i.e. what you have borrowed).</p></li>\r\n  <li><p>5 <u>Missing payments warning</u>: </p></li>\r\n  <li><p>5.1 Missing payments will require you to pay more than the amounts set out in your agreement, which means that the total cost of your debt will grow. If you don&rsquo;t make your payments on time we may record this at Credit Reference Agencies and this may make obtaining credit more difficult and more expensive in the future. If you become insolvent this will remain on your file for 6 years. Missing payments could also result in legal action being taken against you, which could result in a court order being obtained and you incurring legal costs. If a court order secures any outstanding debt against your home, this could lead to your home being repossessed.</p></li>\r\n  <li><p>6 <u>Right of withdrawal</u>: </p></li>\r\n  <li><p>6.1  You have the right, under section 66A of the Consumer Credit Act 1974, to withdraw from this Loan Agreement without giving any reason for doing so for a period of 14 days beginning with the day after the day on which you receive a copy of the executed Loan Agreement. Please make sure you retain a copy of the executed Loan Agreement for your records.</p></li>\r\n  <li><p>6.2 If you choose to exercise your right of withdrawal you must notify us of your intention to do so either in writing or orally, using the contact details provided below. </p></li>\r\n  <li><p>6.3  Unless you make a specific request to withdraw from your loan agreement, early repayments made within the withdraw period shall not be treated as a withdrawal. If you do withdraw, you must repay us, no later than 30 days after giving notice of your withdrawal, any monies paid to you under the Loan Agreement and any interest accrued, from the date the credit was provided up until the date you repay. Interest will accrue daily at the rate of {{product_details.interest_rate|floatformat:2 }} %. </p></li>\r\n  <li><p>6.4 You may exercise this right of withdrawal by giving us notice orally or in writing which clearly states your intention to withdraw as follows:</p></li>\r\n  <ul style=\"list-style:none;\">\r\n   <li><p>(a) to give us oral notice call, {% chunk \"LsAcctSectionNumber\" %}; and</p></li>\r\n   <li><p>(b) to give us notice in writing:</p></li>\r\n   <ul style=\"list-style:none;\">\r\n    <li><p>(i) Send a letter to: Lending Stream, Wisteria Grange Barn, Pikes End, Pinner, London, United Kingdom, HA5 2EX or</p></li>\r\n    <li><p>(ii) Contact us at {% chunk \"contactus-url\" %}.</p></li>\r\n   </ul>\r\n  </ul>\r\n  <li><p>7 <u>Early repayment</u>: </p></li>\r\n  <li><p>7.1  You are entitled at any time, by giving written or oral notice to us and making such payment to us by an agreed method, to discharge your indebtedness under the Loan Agreement in full or in part. You may also be entitled to a rebate for your early repayment calculated in accordance with the Consumer Credit (Early Settlement) Regulations 2004. To exercise this right contact us at {% chunk \"LsAcctSectionNumber\" %} or log in to your account online and follow the directions for early repayment.</p></li>\r\n  <li><p>8<u>  Complaints</u>: </p></li>\r\n  <li><p>8.1  If you have a complaint, please call us on {% chunk \"LsAcctSectionNumber\" %}, contact us at {% chunk \"contactus-url\" %} or at the postal address provided above. We will investigate your complaint, attempt to resolve it and we will respond to you with the outcome.  If you are not satisfied with our response and you are a non-business borrower you will have a right to complain to the Financial Ombudsman Service.  If you are a business borrower, you may have a right to complain to the Financial Ombudsman Service.  You can contact them as follows: </p></li>\r\n  <ul style=\"list-style:none;\">\r\n   <li><p>(a) address: The Financial Ombudsman Service, Exchange Tower, London, E14 9SR;</p></li>\r\n   <li><p>(b) email: <a href=\"mailto:complaint.info@financial-ombudsman.org.uk\">complaint.info@financial-ombudsman.org.uk</a>;</p></li>\r\n   <li><p>(c) telephone: 0800 023 4567 or 0300 123 9123;</p></li>\r\n   <li><p>(d) website: <a href=\'http://www.financial-ombudsman.org.uk\' target=\'_blank\'>www.financial-ombudsman.org.uk</a>.</p></li>\r\n  </ul>\r\n  <li><p>8.2 You may also submit a complaint to the European Commission Online Dispute Resolution portal located at <a href=\"http://ec.europa.eu/consumers/odr/index_en.htm\" target=\"_blank\">http://ec.europa.eu/consumers/odr/index_en.htm</a>.</p></li>\r\n  <li><p>8.3     We are also member of the Consumer Finance Association (\"CFA\"). If you have a complaint about our service or this Loan Agreement, you may also make a complaint directly to the CFA as follows:</p></li>\r\n  <ul style=\"list-style:none;\">\r\n   <li><p>(a) the CFA can be contacted at Consumer Finance Association, 78 Pall Mall, London SW1Y 5ES.</p></li>\r\n  </ul>\r\n  <li><p>8.4     Your right to submit a complaint to the Financial Ombudsman Service or the Online Dispute Resolution portal is independent of your right to complain to the CFA, this means you do not need to refer the complaint to the CFA before referring it to the Financial Ombudsman Service or the Online Dispute Resolution Portal.</p></li>\r\n  <li><p>8.5     For further information on the CFA\'s Good Practice Customer Charter please refer to <a href=\"http://www.cfa-uk.co.uk/wp-content/uploads/2017/08/PDSTL_Charter.pdf\" target=\"_blank\">http://www.cfa-uk.co.uk/wp-content/uploads/2017/08/PDSTL_Charter.pdf</a>.</p></li>\r\n  <li><p>9<u> General</u>: </p></li>\r\n  <li><p>9.1 If we do not enforce our rights under this Loan Agreement at any time we will not be prevented from doing so later.</p></li>\r\n  <li><p>9.2 Any notice or demand we give will be assumed to have been properly given if served on you personally, sent by email to an address you have provided, or left or sent by prepaid envelope addressed to you at your current address or last known business or private address. If sent by first class post it will be assumed to have been received by you 48 hours after posting.</p></li>\r\n  <li><p>9.3  We may transfer or assign all or any of our rights under this Loan Agreement without your consent but if we do so you will be informed of this.</p></li>\r\n  <li><p>9.4 This Loan Agreement shall be construed according to the laws of England and Wales (or Scotland if you live there). The courts of England and Wales or Scotland (as appropriate to the borrower) will have exclusive jurisdiction over matters arising in relation to this credit agreement.</p></li>\r\n  <li><p>9.5 The contractual terms and conditions, and the prior information, are in English. We undertake, with your agreement, to communicate with you in English during the duration of this Loan Agreement.</p></li>\r\n </ul>\r\n <p>Authorised and Regulated by the Financial Conduct Authority, 25 The North Colonnade, Canary Wharf, London, E14 5HS.  Registration Number 689378</p>\r\n <p>Registered Address: {% chunk \"LLCRegisteredAddress\" %}, Registered in the State of Delaware, USA, Registration Number: 4124111.  Our main business is consumer lending.</p>\r\n <h4><p align=\"center\"><strong>HOW WE USE YOUR INFORMATION</strong></p></h4>\r\n <ul class=\"terms-list1\" style=\"list-style:none\">\r\n  <li><p>1. The information we collect from you is used by us to assess your creditworthiness, to manage your account and to make collections. It is also used to contact you for marketing purposes to offer you products from {% chunk \"new-lender-name-only\" %}. It is disclosed by us when legally required to do so at the request of government authorities conducting an investigation. We also use it to verify or enforce compliance with the policies governing our website and applicable laws or to protect against misuse or unauthorised use of our website.</p></li>\r\n  <li><p>2. While considering whether to enter into this Loan Agreement, we may search your record at credit reference agencies. They will add to their records about you, details of our search and your application and this will be seen by other organisations that make searches. We may also add to your records with the credit reference agencies details of your Loan Agreement with us, the payments you make under it and any default or failure to keep to its terms. These records will be shared with other organisations and may be used and searched by us and them in order to:</p></li>\r\n  <ul style=\"list-style-type: none;\">\r\n   <li><p>2.1. consider applications for credit and credit related services such as insurance for you and any associated person;</p></li>\r\n   <li><p>2.2. trace debtors, recover debts, prevent or detect money laundering and fraud; and</p></li>\r\n   <li><p>2.3. to manage your accounts.</p></li>\r\n  </ul>\r\n  <li><p>3. It is important that you provide us with accurate information. We may check your details with fraud prevention agencies and if you provide false or inaccurate information or we suspect fraud, this information may be recorded. Fraud prevention agency records will be shared with other organisations to help make decisions on credit, motor, household, life and other insurance proposals or claims for you and members of your household.</p></li>\r\n  <li><p>4. Please contact us if you require details of the credit reference agencies or any other agencies from whom we obtain, and whom we pass, information about you. You have a legal right to these details. You also have the legal right to receive a copy of the information we hold about you if you apply to us in writing. A small statutory fee will be levied.</p></li>\r\n  <li><p>5. We may use your information to inform you by post, fax, telephone, email or other electronic means, about other products and services (including those of others) which we believe may be of interest to you. We will only pass your personal data to third parties for the purposes of electronic marketing when you have expressly opted in to receive such material. You may opt out of receiving such third party marketing material at any stage.</p></li>\r\n  <li><p>6. If you are not eligible for the loan for which you applied at this time then (i) we may offer you an alternative product, which may be on different terms, if responsible to do so (including those of others) and (ii) if you have provided us with express consent, we may pass your details to another financial services company for them to send you details of their products.</p></li>\r\n  <li><p>7. You may have already opted-out of receiving these marketing communications from us by ticking the appropriate box on the Privacy Policy, but if not you may do so at any time by responding to any of our email communications with \"remove\" in the subject line, by sending us an email or post to the email id and address provided above.</p></li>\r\n  <li><p>8. If you opt-out of use of your data for marketing purposes, we will honour such choice once we have had a reasonable opportunity to process your request. We reserve the right to take reasonable steps to authenticate your identity with respect to any such request or other enquiry.</p></li>\r\n  <li><p>9. Your data remains on file for 6 years after our files with your information are closed, whether settled by you or in default.</p></li>\r\n  <li><p>10. From time to time, service providers and organisations with whom we work to provide services to you or credit reference agencies with which we work, may be located outside the European Economic Area in countries that do not have the same standards of protection for personal data as the UK. These countries may include India and the USA. We will, however, always use every reasonable effort to ensure sufficient protections are in place to safeguard your personal data.</p></li>\r\n  <li><p>11. This is a condensed version of how we deal with your information. Further and fuller information is provided in our Privacy Policy, which is available on request, or can be found at <a href=\'http://www.lendingstream.co.uk\' target=\'_blank\'>www.lendingstream.co.uk</a>.</p></li>\r\n  <li><p>12. We are registered with the Information Commissioner in compliance with the Data Protection Act 1998. Our registration number is Z2752028.</p></li>\r\n  </ul>\r\n  </ul>\r\n <div id=\"footerContent\">\r\n               <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n               Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br />\r\n               Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n         </div>\r\n     </div>\r\n \r\n </body>\r\n </html>','agreement',1,1,'2016-05-10 18:55:42.587820','2016-05-10 18:55:42.588788','2017-12-08 09:28:58.000000',1,2,''),('ANNUALSTATEMENTDOC','{% load chunks %}\r\n  {% load space_filter %}\r\n  <!DOCTYPE HTML>\r\n  <!DOCTYPE HTML>\r\n  <HTML>\r\n  <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n      \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n      <html>\r\n      <head>\r\n          <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n          <style type=\"text/css\" media=\"all\">\r\n              @page {\r\n              margin: 0.5cm;\r\n              margin-top:1.8cm;   \r\n              margin-bottom: 1.8cm;\r\n              @frame footer {\r\n              -pdf-frame-content: footerContent;\r\n              bottom: 0cm;\r\n              margin-left: 0.75cm;\r\n              margin-right: 0.75cm;            \r\n              font-size:8px;\r\n              height: 1.5cm;\r\n              }           \r\n              }\r\n          </style>\r\n      </head>\r\n      <body>\r\n           <!--html content-->\r\n           <table width=\"100%\">\r\n              <tr>\r\n                  <td></td>\r\n                  <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n              </tr>\r\n          </table>\r\n          <p align=\"right\">\r\n              <font color=\"SteelBlue\">{{lender_name}},\r\n                  <br/>{{lender_street1}},\r\n                  <br/>{{lender_street2}},\r\n                  <br/>{{lender_city}},\r\n                  <br/>{{lender_county}},\r\n                  <br/>{{lender_postcode}}, {{lender_country}}.\r\n                  <br/>Customer Services T:{{customercare_contact_tp}}*,\r\n                  <br/> Website:{{lender_website}}</font>\r\n          </p>\r\n               <p align=\"left\">\r\n              {% if cust_Prefix %}\r\n              {{cust_Prefix|title}} &nbsp;\r\n              {%endif%}\r\n              {% if cust_firstname %}\r\n              {{cust_firstname}}&nbsp;\r\n              {%endif%} \r\n              {% if cust_middlename %}\r\n              {{cust_middlename}} &nbsp;\r\n              {%endif%}\r\n              {% if cust_lastname %}\r\n              {{cust_lastname}}\r\n              {%endif%}\r\n              <br/>{% if Apt_No %} {{Apt_No}} {%endif%} {% if Build_Name %} {{Build_Name}} {%endif%}\r\n              <br/>{% if Build_No %} {{Build_No}} {%endif%} {% if Street %} {{Street}} {%endif%}\r\n              <br/>{% if county %} {{county}} {%endif%} {% if city %} {{city}} {%endif%}\r\n              <br/>{% if postcode %} {{postcode}} {%endif%}</p>\r\n          <p align=\"right\">Date: {{cur_Date}}</p>\r\n          <p align=\"left\">Dear {{CustomerFname_CustomerLName}},</p>\r\n          <p><strong><u>Annual statement of account for fixed sum credit agreement</u></strong></p>\r\n          <p><strong>Statement Period:  {{astmt_start_date}} to {{astmt_end_date}}</strong></p>\r\n          <p>This is your annual statement for your fixed sum loan agreement, dated {{agreement_date}} for loan reference ID {{loan_id}} between you and GAIN Credit LLC (trading as Lending Stream). This is in accordance with section 77A of the Consumer Credit Act 1974.</p>\r\n\r\n          <p><strong>Account Summary</strong></p>\r\n          <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n            <tr>\r\n                <td width=\"30%\">Agreement Date</td>\r\n                <td>{{agreement_date}} </td>\r\n            </tr>\r\n            <tr>\r\n                <td>Original Loan Duration</td>\r\n                <td>{{original_loan_duration}}</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Loan Amount</td>\r\n                <td>&pound;{{loan_amount|floatformat:2}} </td>\r\n            </tr>\r\n            <tr>\r\n                <td>Interest Rate</td>\r\n                <td>Interest is charged for the Duration of the Loan Agreement at the fixed flat rate of {{interest_rate|floatformat:2}}% of the capital balance outstanding (or &pound;{{interest_rate|floatformat:2}} per &pound;100.00 outstanding) per day equating to {{annual_interest|floatformat:2}}% per annum. Interest is calculated on the capital balance outstanding at the beginning of each day.</td>\r\n            </tr>\r\n        </table>\r\n        <br/>\r\n        <p><strong>Repayment History </strong></p>\r\n          <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n              <thead>\r\n                  <tr>\r\n                      <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                          Date\r\n                      </th>\r\n                      <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                          Description\r\n                      </th>\r\n                      <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                            Credit  (&pound;)\r\n                      </th>\r\n                      <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                            Debit  (&pound;)\r\n                      </th>\r\n                      <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                            Balance  (&pound;)\r\n                      </th>\r\n                  </tr>\r\n              </thead>\r\n              {% for value in table %}\r\n              <tr>\r\n                  <td>{{value.date}}</td>\r\n                  <td>{{value.description}}</td>\r\n                  <td>{{value.credit|floatformat:2}}</td>\r\n                  <td>{{value.debit|floatformat:2}}</td>\r\n                  <td>{{value.balance|floatformat:2}}</td>\r\n              </tr>\r\n              {% endfor %}\r\n          </table>\r\n          <br/>\r\n          <p><strong>Dispute resolution </strong></p>\r\n          <p>If you have a problem, please try to resolve it with us in the first instance. If you are not happy with the way in which we handled your complaint or the result, you may be able to complain to the Financial Ombudsman Service. If you do not take up your problem with us first, you will not be entitled to complain to the Ombudsman. We can provide details of how to contact the Ombudsman.</p>\r\n          <p><strong>Paying less than the agreed sum: </strong></p>\r\n          <p>If you pay less than your agreed payment, it is likely to take you longer and may cost you more to pay off the debt under the agreement.</p>\r\n          <p>\r\n                If you have difficulties making payments under your credit agreement, please contact us (if you have not already done so) to discuss terms for the rest of the agreement. You may also want to seek advice on what to do from an independent free advice agency such as the Citizens Advice Bureau.\r\n          </p>\r\n          <p>If you have any queries regarding this information, please contact us online at {{contact_us_link}}.</p>\r\n          <br/>\r\n          <p>Regards</p>\r\n          <p>Lending Stream Customer Service</p>\r\n          <p>* Call charges apply. Standard charges from BT landlines, mobiles and other providers may vary.</p>\r\n           <!-- html content end -->\r\n         \r\n      <div id=\"footerContent\">\r\n                <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n                Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br />\r\n                Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n          </div>\r\n      </div>\r\n  \r\n  </body>\r\n  </html>','AnnualStatementDocument',1,1,'2018-12-04 12:58:31.696199','2018-12-04 12:58:42.185766','2018-12-06 07:14:52.983885',1,2,'Approved'),('dc-theft-affidavit','{% load chunks %}\r\n <html>\r\n \r\n <head>\r\n     <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n     <style type=\"text/css\" media=\"all\">\r\n     @page {\r\n         margin: 0.5cm;\r\n         margin-top: 1.8cm;\r\n         margin-bottom: 1.8cm;\r\n         @frame footer {\r\n             -pdf-frame-content: footerContent;\r\n             bottom: 0cm;\r\n             margin-left: 0.75cm;\r\n             margin-right: 0.75cm;\r\n             font-size: 8px;\r\n             height: 1.5cm;\r\n         }\r\n     }\r\n     </style>\r\n </head>\r\n \r\n <body>\r\n     <table width=\"100%\">\r\n         <tr>\r\n             <td></td>\r\n             <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right /></td>\r\n         </tr>\r\n     </table>\r\n     <p align=\"right\">\r\n         <font color=\"gray\">\r\n             <br/>Lending Stream\r\n             <br/>Wisteria Grange Barn\r\n             <br/>Pikes End Pinner London\r\n             <br/>United Kingdom HA5 2EX\r\n             <br/>Tel: 0203 365 0133\r\n             <br/>Fax: 0844 507 0675\r\n             <br/>Contact:  {% chunk \"contactus-url\" %}\r\n             <br/>Web: <a href=\"http://www.lendingstream.co.uk\" target=\"_blank\">www.lendingstream.co.uk</a></font>\r\n     </p>\r\n     <h2 align=\"center\">ACKNOWLEDGEMENT OF FRAUD</h2>\r\n     <p style=\"font-size:16px;\"><strong>Return via fax at 0844 507 0675</p>\r\n     <br>\r\n     <br>\r\n     <p style=\"font-size:16px;\"><strong>SECTION 1</strong></p>\r\n     <p>Name________________________________________</p>\r\n     <p>Date of birth (DD/MM/YYYY) ____________ /___________ /_____________.</p>\r\n     <p>Postal address __________________________________________________________________________.</p>\r\n     <p>Telephone number __________________</p>\r\n     <br>\r\n     <p style=\"font-size:16px;\"><strong>SECTION 2</strong></p>\r\n     <p>To the best of my knowledge, my bank account and/or debit card was accessed and used by an unauthorized person approximately from_______________.</p>\r\n     <p>I did not authorize anyone to use my bank account or debit card information to establish and/ or use Lending Stream Loan ID/ or Loan Agreement Number _________________</p>\r\n     <p>I learned of the fraud from Lending Stream on _________ (DD/MM/YYYY) and for the amount of &pound;________.</p>\r\n     <br>\r\n     <p style=\"font-size:16px;\"><strong>SECTION 3</strong></p>\r\n     <p>I believe that the facts stated in this acknowledgment of fraud document are true to the best of my knowledge.</p>\r\n     <br>\r\n     <br>\r\n     <br>\r\n     <br>\r\n     <table>\r\n         <tr>\r\n             <td width=\"30%\">_____________________________</td>\r\n             <td width=\"40%\">&nbsp;</td>\r\n             <td width=\"30%\">______________________________</td>\r\n         </tr>\r\n         <tr>\r\n             <td width=\"30%\">(Signature)</td>\r\n             <td width=\"40%\">&nbsp;</td>\r\n             <td width=\"30%\">(Date of Signature)</td>\r\n         </tr>\r\n     </table>\r\n     <div id=\"footerContent\">\r\n         <div class=\"footer\" style=\"text-align:center;color:steelblue;font-size:12px;\">\r\n             Authorised and Regulated by the Financial Conduct Authority. Registration Number 689378.\r\n             <br/> Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111 Page\r\n             <pdf:pagenumber/>\r\n         </div>\r\n     </div>\r\n     <div id=\"footerContent\">\r\n         <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n             Authorised and Regulated by the Financial Conduct Authority.\r\n             <br /> Registered Address: {% chunk \"LLCRegisteredAddress\" %}. Registered in the State of Delaware, USA. Registration Number: 4124111\r\n         </div>\r\n     </div>\r\n </body>\r\n </html>','dc theft affidavit',1,1,'2016-06-01 10:33:05.153896','2016-06-01 10:33:05.155275','2017-12-08 09:28:58.000000',1,2,''),('default-notice','{% load chunks %}\r\n<!DOCTYPE HTML>\r\n<HTML>\r\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n    \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n    <html>\r\n    <head>\r\n        <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n        <style type=\"text/css\" media=\"all\">\r\n            @page {\r\n            margin: 0.5cm;\r\n            margin-top:1.8cm;   \r\n            margin-bottom: 1.8cm;\r\n            @frame footer {\r\n            -pdf-frame-content: footerContent;\r\n            bottom: 0cm;\r\n            margin-left: 0.75cm;\r\n            margin-right: 0.75cm;            \r\n            font-size:8px;\r\n            height: 1.5cm;\r\n            }           \r\n            } \r\n        </style>\r\n    </head>\r\n    <body>\r\n         <table width=\"100%\">\r\n            <tr>\r\n                <td></td>\r\n                <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n            </tr>\r\n        </table>\r\n        <p align=\"right\">\r\n            <font color=\"SteelBlue\">\r\n                <br/>{{lender_name}},\r\n                <br/>{{lender_street1}},\r\n                <br/>{{lender_street2}},\r\n                <br/>{{lender_city}},\r\n                <br/>{{lender_county}},\r\n                <br/>{{lender_postcode}}, {{lender_country}}.\r\n                <br/>\r\n                <br/>Arrears Management T {{customercare_contact_tp}}</font>\r\n        </p>\r\n                <br/>\r\n                <br/>\r\n                <br/>\r\n                <br/>\r\n        <p align=\"left\">\r\n            {% if cust_Prefix %}\r\n            {{cust_Prefix|title}} &nbsp;\r\n            {%endif%}\r\n            {% if cust_firstname %}\r\n            {{cust_firstname}}&nbsp;\r\n            {%endif%} \r\n            {% if cust_middlename %}\r\n            {{cust_middlename}} &nbsp;\r\n            {%endif%}\r\n            {% if cust_lastname %}\r\n            {{cust_lastname}}\r\n            {%endif%}\r\n            <br/>{% if Apt_No %} {{Apt_No}} {%endif%} {% if Build_Name %} {{Build_Name|title}} {%endif%}\r\n            <br/>{% if Build_No %} {{Build_No}} {%endif%} {% if Street %} {{Street|title}} {%endif%}\r\n            <br/>{% if county %} {{county|title}} {%endif%} {% if city %} {{city|title}} {%endif%}\r\n            <br/>{% if postcode %} {{postcode|upper}} {%endif%}</p>\r\n        <p align=\"right\">Date : {{cur_Date}}</p>\r\n        <p align=\"center\"><strong><u>IMPORTANT &#8211; YOU SHOULD READ THIS CAREFULLY</u></strong>\r\n            <br/>\r\n            <strong align=\"center\"><u>DEFAULT NOTICE</u></strong>\r\n            <br/>\r\n            <strong align=\"center\">Served under Section 87 (1) of the Consumer Credit Act 1974</strong></p>\r\n        <p> <strong><u>Details of the breach</u></strong></p>\r\n        <p>You are now in breach of your fixed sum loan agreement with us, agreement reference number {{lead_id}} and dated {{fund_dt}} which is regulated by the Consumer Credit Act 1974.</p>\r\n\r\n        <p>Under the terms of the agreement you borrowed &pound;{{borrowed_amt|floatformat:2}} repayable by {{cycle}} {{repay_frequency}} instalments commencing on {{first_paydate}} and repayable in the instalments and on the dates specified in your fixed sum loan agreement. </p>\r\n\r\n        <p>You have failed to pay the following instalment(s) on the due date(s), in breach of the terms of the loan agreement, specifically the \"Timing and Amount of Repayments\" term: </p>\r\n\r\n        {% for key,value in due_amt_list.iteritems %}\r\n        &pound;{{value.payamt|floatformat:2}} was due on {{value.duedate}}\r\n        <br/>{% endfor%}<br/>\r\n\r\n        <p>Further, you have accrued the following charges in respect of your arrears:</p>\r\n        {% for key,value in fee_list.iteritems %}\r\n        {% ifequal value.payment_type \"ARREAR FEE\" %}\r\n        <p>&pound;{{value.payamt|floatformat:2}} missed payment fee in respect of the payment due on \r\n            {{value.duedate}}</p>\r\n        <br/>\r\n        {% endifequal %}\r\n        {% endfor %} \r\n\r\n        {%ifequal interest_frequency \"monthly\"%} \r\n\r\n        {% for key,value in fee_list.iteritems %}\r\n        \r\n        {% ifequal value.payment_type \"DEFAULT FEE\" %}\r\n        &pound;{{value.payamt|floatformat:2}} \r\n        arrears fee as your account has now been overdue for over \r\n        {{NOD_days}} days,\r\n        {% endifequal %}\r\n        {% endfor %}\r\n        {%endifequal%}\r\n\r\n        <p> &pound;{{default_sum}} of default interest </p>\r\n        <p> As at the date of this notice the total amount of your arrears, including all default interest and default/arrears charges is &pound;{{due_amt|floatformat:2}}.</p>\r\n        <p><strong><u>Action required to remedy Breach</u></strong></p>\r\n        <p>Immediate action is required to remedy this breach. You are required to contact us to discuss your arrears and to pay us the total amount of arrears of &pound;{{due_amt|floatformat:2}} outstanding on your account by {{silence_period}}. You must also ensure that you make any payments that fall due under the agreement between the date of this notice and {{silence_period}}, on time and in full.</p>\r\n        <p><strong>IF THE ACTION REQUIRED BY THIS NOTICE IS TAKEN <u>BEFORE THE DATE SHOWN</u> NO FURTHER ENFORCEMENT ACTION WILL BE TAKEN IN RESPECT OF THE BREACH.</strong></p>\r\n        <p><strong> IF YOU DO <u>NOT</u> TAKE THE ACTION REQUIRED BY THIS NOTICE <u>BEFORE THE DATE SHOWN</u> THEN THE FURTHER ACTION SET OUT BELOW MAY BE TAKEN AGAINST YOU.</strong></p>\r\n        <p>If you fail to pay us the total arrears by {{silence_period}} and/or fail to make any of the payments due under your agreement between that date and the date of this notice, we may:</p>\r\n        <p>\r\n            <ol>\r\n                <li>Register your default with the credit reference agencies to which we subscribe</li>\r\n                <li>Terminate the agreement with immediate effect </li>\r\n                <li>Demand earlier payment of the full outstanding balance under the agreement (see below)</li>\r\n                <li>Seek to recover from you our costs of enforcing the agreement.</li>\r\n            </ol>\r\n        </p>\r\n        <p>If we terminate the agreement and demand the full outstanding balance, the amount which you will be required to pay is as follows:\r\n            <p>Balance Outstanding &pound;{{outstanding_balance.outstanding_balance|floatformat:2}}\r\n                <p>\r\n                    <p>* This figure assumes termination of the Agreement on the date shown without further notice.\r\n                        <p>\r\n                            <p>If you cannot pay the arrears in full by {{silence_period}} and/or meet your repayments due between that date and the date of this notice, you are strongly urged to contact us on {{lender_phone1}}. You will be able to speak to specially trained members of staff who will assist you. If you are experiencing repayment difficulties or hardship then please let us know and we will work with you to agree an alternative repayment strategy.</p>\r\n                            <p>IF YOU HAVE DIFFICULTY IN PAYING ANY SUM OWING UNDER THE AGREEMENT OR TAKING ANY OTHER ACTION REQUIRED BY THIS NOTICE, YOU CAN APPLY TO THE COURT WHICH MAY MAKE AN ORDER ALLOWING YOU OR ANY SURETY MORE TIME.</p>\r\n                            <p>IF YOU ARE NOT SURE WHAT TO DO, YOU SHOULD GET HELP AS SOON AS POSSIBLE. FOR EXAMPLE, YOU SHOULD CONTACT A SOLICITOR, YOUR LOCAL TRADING STANDARDS DEPARTMENT OR YOUR NEAREST CITIZENS\' ADVICE BUREAU.</p>\r\n                            <p>This notice should include a copy of the current Financial Conduct Authority information sheet on default. This contains important information about your rights and where to go for support and advice. If it is not included, you should contact us to get one.</p>\r\n       \r\n\r\n        <div id=\"footerContent\">\r\n              <div class=\"footer\" style=\"text-align:center;color:steelblue;font-size:12px;\">\r\n                Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br/>\r\nRegistered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111 Page <pdf:pagenumber/>\r\n              </div>\r\n        </div>\r\n    <div id=\"footerContent\">\r\n              <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n              Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br />\r\n              Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n        </div>\r\n    </div>\r\n\r\n</body>\r\n</html>','default notice',1,1,'2016-05-10 18:56:58.501869','2016-05-10 18:56:58.503116','2017-12-08 09:28:58.000000',1,2,''),('further-notice-of-sum-in-arrears','{% load chunks %}\r\n          {% load space_filter %}\r\n          <!DOCTYPE HTML>\r\n          <!DOCTYPE HTML>\r\n          <HTML>\r\n          <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n              \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n              <html>\r\n              <head>\r\n                  <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n                  <style type=\"text/css\" media=\"all\">\r\n                      @page {\r\n                      margin: 0.5cm;\r\n                      margin-top:1.8cm;\r\n                      margin-bottom: 1.8cm;\r\n                      @frame footer {\r\n                      -pdf-frame-content: footerContent;\r\n                      bottom: 0cm;\r\n                      margin-left: 0.75cm;\r\n                      margin-right: 0.75cm;\r\n                      font-size:8px;\r\n                      height: 1.5cm;\r\n                      }\r\n                      }\r\n                  </style>\r\n              </head>\r\n              <body>\r\n                   <!--html content-->\r\n                   <table width=\"100%\">\r\n                      <tr>\r\n                          <td></td>\r\n                          <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n                      </tr>\r\n                  </table>\r\n                  <p align=\"right\">\r\n                      <font color=\"SteelBlue\">{{lender_name}}\r\n                          <br/>{{lender_street1}}\r\n                          <br/>{{lender_street2}}\r\n                          <br/>{{lender_county}}\r\n                          <br/>{{lender_city}}\r\n                          <br/>{{lender_postcode}}\r\n                          <br/>{{lender_country}}\r\n                          <br/>Customer Service Telephone: {{customercare_contact_tp}}\r\n                          <br/> Contact us at: {{contact_us_link}}</font>\r\n                  </p>\r\n                       <p align=\"left\">\r\n                      {% if cust_Prefix %}{{cust_Prefix|title}} {%endif%}{% if cust_firstname %}{{cust_firstname}} {%endif%}{% if cust_middlename %}{{cust_middlename}} {%endif%}{% if cust_lastname %}{{cust_lastname}}{%endif%}\r\n                      {% if Apt_No or Build_Name %}<br/>{% if Apt_No %} {{Apt_No}} {%endif%} {% if Build_Name %} {{Build_Name}} {%endif%}{%endif%}\r\n                      <br/>{% if Build_No %} {{Build_No}} {%endif%} {% if Street %} {{Street}} {%endif%}\r\n                      <br/>{% if county %} {{county}} {%endif%} {% if city %} {{city}} {%endif%}\r\n                      <br/>{% if postcode %} {{postcode}} {%endif%}</p>\r\n                  <p align=\"right\">{{run_Date}}</p>\r\n                  <p align=\"center\"><strong><u>IMPORTANT &#8211; YOU SHOULD READ THIS CAREFULLY</u></strong>\r\n                      <br>\r\n                      <strong align=\"center\"><u>NOTICE OF SUMS IN ARREARS</u></strong>\r\n                      <br>\r\n                      <strong align=\"center\">Served under Section 86B of the Consumer Credit Act 1974</strong></p>\r\n                  <p align=\"left\">This Notice of Sums in Arrears now served on you relates to a Fixed-Sum Credit Agreement (number {{lead_id}} and dated {{fund_dt}}) entered into by you with {% chunk \"new-lender-name\" %} of the above address.</p>\r\n                  {% if doc_category == \"TA_DMP_FNOSIA\" %}\r\n                  <p>Although you are currently on a repayment plan with us, we are required to send you this notice in compliance with the Consumer Credit Act 1974 because you are behind with your contractual payments under the agreement.  Unless we tell you otherwise, we will continue to accept repayments from you in accordance with your repayment plan.  </p>\r\n                  {% else %}\r\n                  <p>This notice is given in compliance with the Consumer Credit Act 1974 because you are behind with your payments under the agreement.</p>\r\n                  <p>You are encouraged to contact us to discuss your account. Our contact details are provided above.</p>\r\n                  {% endif %}\r\n  \r\n  \r\n                  <p>The amounts and dates of any sums you have paid us and the amount and dates any interest or other charges that have become due during the period covered by this notice are shown below.</p>\r\n  \r\n                  <p>Period covered by this Notice: {{prev_run_date}} to {{cur_Date}}</p>\r\n  \r\n                  <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n                      <thead>\r\n                          <tr>\r\n                              <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                                  Date\r\n                              </th>\r\n                              <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                                 Interest/Charges (&pound;)\r\n                              </th>\r\n                              <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                                  Payments (&pound;)\r\n                              </th>\r\n                              <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                                  Waiver (&pound;)\r\n                              </th>\r\n                              <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                                  Refund (&pound;)\r\n                              </th>\r\n                              <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                                Outstanding Balance (&pound;)\r\n                              </th>\r\n                              <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                                Cumulative shortfall (&pound;)\r\n                              </th>\r\n                          </tr>\r\n                      </thead>\r\n                      {% for value in table %}\r\n                      <tr>\r\n                          <td>{{value|get:\"paydate\"}}</td>\r\n                          <td>&pound;{{value|get:\"interest_charges\"|floatformat:2}}</td>\r\n                          <td>&pound;{{value|get:\"payment\"|floatformat:2}}</td>\r\n                          <td>&pound;{{value|get:\"waiver\"|floatformat:2}}</td>\r\n                          <td>&pound;{{value|get:\"refund\"|floatformat:2}}</td>\r\n                          <td>&pound;{{value|get:\"ob\"|floatformat:2}}</td>\r\n                          <td>&pound;{{value|get:\"sf\"|floatformat:2}}</td>\r\n                      </tr>\r\n                      {% endfor %}\r\n                  </table>\r\n                  <br />\r\n                  {% if doc_category == \"TA_DMP_FNOSIA\" %}\r\n                  <p>You are encouraged to contact us to discuss your account. Our contact details are provided above.</p>\r\n                  {% endif %}\r\n                  <p><strong>Default sums and Interest</strong></p>\r\n                  <p>You may have to pay default sums and interest in relation to the missed or partly made payments referred to in this notice (in addition to any default sums and interest included in this notice). Please contact us if you would like further details. This notice does not take into account any payments received after the date of the notice.</p>\r\n  \r\n                  <p><strong>Notices</strong></p>\r\n                  <p>For so long as you continue to be behind with your payments by any amount, you will be sent notices about this at least every six months. We are not required to send you notices more frequently than this, even if you get further behind with your payments in between notices.</p>\r\n                  <p>You have not been charged for the preparation or delivery of this notice.</p>\r\n  \r\n                  <p><strong>Financial Conduct Authority Information Sheet</strong></p>\r\n                  <p>This notice should include a copy of the current information sheet on arrears prepared by the Financial Conduct Authority. This contains important information about your rights and where to go for support and advice, for example on applying for a Time Order as well as our right to charge you interest. If it is not included you should contact us to get one.</p>\r\n  \r\n                  <p>Please refer to the Financial Conduct Authority information sheet for more information about how to get advice on dealing with your debt. </p>\r\n  \r\n                  <p>Regards,</p>\r\n                  <p>Lending Stream Customer Care Team</p>\r\n                  <p>*Call charges apply. Standard charges from BT landlines, mobiles and other providers may vary.</p>\r\n                   <!-- html content end -->\r\n                  <div id=\"footerContent\">\r\n                        <div class=\"footer\" style=\"text-align:center;color:steelblue;font-size:12px;\">\r\n                          Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br/>\r\n          Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111 Page <pdf:pagenumber/>\r\n                        </div>\r\n                  </div>\r\n              <div id=\"footerContent\">\r\n                        <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n                        Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br />\r\n                        Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n                  </div>\r\n              </div>\r\n  \r\n          </body>\r\n          </html>','further-notice-of-sum-in-arrears',1,1,'2018-12-21 11:49:24.664182','2018-12-21 11:50:03.748879','2018-12-21 11:50:09.634154',1,2,''),('id-theft-affidavit','{% load chunks %}\r\n <html>\r\n <head>\r\n         <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n         <style type=\"text/css\" media=\"all\">\r\n             @page {\r\n             margin: 0.5cm;\r\n             margin-top:1.8cm;\r\n             margin-bottom: 1.8cm;\r\n             @frame footer {\r\n             -pdf-frame-content: footerContent;\r\n             bottom: 0cm;\r\n             margin-left: 0.75cm;\r\n             margin-right: 0.75cm;\r\n             font-size:8px;\r\n             height: 1.5cm;\r\n             }\r\n             }\r\n         </style>\r\n     </head>\r\n <body>\r\n 		<table width=\"100%\">\r\n             <tr>\r\n                 <td></td>\r\n                 <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n             </tr>\r\n         </table>\r\n         <p align=\"right\">\r\n             <font color=\"gray\">\r\n                 <br/>Lending Stream\r\n                 <br/>Wisteria Grange Barn\r\n                 <br/>Pikes End Pinner London\r\n                 <br/>United Kingdom HA5 2EX\r\n                 <br/>Tel: 0203 365 0133\r\n                 <br/>Fax: 0844 507 0675\r\n                 <br/>Contact:  {% chunk \"contactus-url\" %}\r\n                 <br/>Web: <a href=\"http://www.lendingstream.co.uk\" target=\"_blank\">www.lendingstream.co.uk</a></font>\r\n         </p>\r\n         <h2 align=\"center\">ACKNOWLEDGEMENT OF FRAUD</h2>\r\n         <p style=\"font-size:16px;\"><strong>Return via fax at 0844 507 0675</p>\r\n         <br>\r\n         <br>\r\n         <p style=\"font-size:16px;\"><strong>SECTION 1</strong></p>\r\n         <p>Name________________________________________</p>\r\n         <p>Date of birth (DD/MM/YYYY) ____________ /___________ /_____________.</p>\r\n         <p>Postal address __________________________________________________________________________.</p>\r\n         <p>Telephone number __________________</p>\r\n         <br>\r\n         <p style=\"font-size:16px;\"><strong>SECTION 2</strong></p>\r\n         <p>To the best of my knowledge, my identity had been fraudulently misused since _______________.</p>\r\n         <p>I did not authorize anyone to use my Identity to establish and/ or use Lending Stream Loan ID/\r\n 		or Loan Agreement Number _________________</p>\r\n 		<p>I learned of the fraud from Lending Stream on _________ (DD/MM/YYYY) and for the amount of &pound;________.</p>\r\n 		<br>\r\n         <p style=\"font-size:16px;\"><strong>SECTION 3</strong></p>\r\n         <p>I believe that the facts stated in this acknowledgment of fraud document are true to the best of\r\n my knowledge.</p>\r\n 		<br>\r\n         <br>\r\n         <br>\r\n         <br>\r\n 		<table>\r\n 			<tr>\r\n 				<td width=\"30%\">_____________________________</td>\r\n 				<td width=\"40%\">&nbsp;</td>\r\n 				<td width=\"30%\">______________________________</td>\r\n 			</tr>\r\n 			<tr>\r\n 				<td width=\"30%\">(Signature)</td>\r\n 				<td width=\"40%\">&nbsp;</td>\r\n 				<td width=\"30%\">(Date of Signature)</td>\r\n 			</tr>\r\n 		</table>\r\n 		<div id=\"footerContent\">\r\n               <div class=\"footer\" style=\"text-align:center;color:steelblue;font-size:12px;\">\r\n                 Authorised and Regulated by the Financial Conduct Authority. Registration Number 689378.<br/>\r\n Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111 Page <pdf:pagenumber/>\r\n               </div>\r\n         </div>\r\n     <div id=\"footerContent\">\r\n               <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n               Authorised and Regulated by the Financial Conduct Authority.<br />\r\n               Registered Address: {% chunk \"LLCRegisteredAddress\" %}. Registered in the State of Delaware, USA. Registration Number: 4124111\r\n         </div>\r\n     </div>\r\n </body>\r\n </html>\r\n','id theft affidavit',1,1,'2016-06-01 10:33:54.404350','2016-06-01 10:33:54.405434','2017-12-08 09:28:58.000000',1,2,''),('notice-of-default-sums','{% load chunks %}\r\n {% load space_filter %}\r\n <!DOCTYPE HTML>\r\n <HTML>\r\n <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n     \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n     <html>\r\n     <head>\r\n         <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n         <style type=\"text/css\" media=\"all\">\r\n             @page {\r\n             margin: 0.5cm;\r\n             margin-top:1.8cm;   \r\n             margin-bottom: 1.8cm;\r\n             @frame footer {\r\n             -pdf-frame-content: footerContent;\r\n             bottom: 0cm;\r\n             margin-left: 0.75cm;\r\n             margin-right: 0.75cm;            \r\n             font-size:8px;\r\n             height: 1.5cm;\r\n             }           \r\n             }\r\n         </style>\r\n     </head>\r\n     <body>\r\n          <!--html content-->\r\n          <table width=\"100%\">\r\n             <tr>\r\n                 <td></td>\r\n                 <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n             </tr>\r\n         </table>\r\n         <p align=\"right\">\r\n             <font color=\"SteelBlue\">Contact Address:\r\n                 <br/>{{lender_name}},\r\n                 <br/>{{lender_street1}},\r\n                 <br/>{{lender_street2}},\r\n                 <br/>{{lender_city}},\r\n                 <br/>{{lender_county}},\r\n                 <br/>{{lender_postcode}}, {{lender_country}}.\r\n                 <br/>Telephone: {{customercare_contact_tp}}\r\n                 <br/>Contact: {% chunk \"contactus-url\" %}</font>\r\n         </p>\r\n         <p align=\"left\"> {% if cust_Prefix %}\r\n             {{cust_Prefix|title}} &nbsp;\r\n             {%endif%}\r\n             {% if cust_firstname %}\r\n             {{cust_firstname}}&nbsp;\r\n             {%endif%} \r\n             {% if cust_middlename %}\r\n             {{cust_middlename}} &nbsp;\r\n             {%endif%}\r\n             {% if cust_lastname %}\r\n             {{cust_lastname}}\r\n             {%endif%}\r\n             <br/>{% if Apt_No %} {{Apt_No}} {%endif%} {% if Build_Name %} {{Build_Name}} {%endif%}\r\n             <br/>{% if Build_No %} {{Build_No}} {%endif%} {% if Street %} {{Street}} {%endif%}\r\n             <br/>{% if county %} {{county}} {%endif%} {% if city %} {{city}} {%endif%}\r\n             <br/>{% if postcode %} {{postcode}} {%endif%}</p>\r\n         <p align=\"right\">{{cur_Date}}</p>\r\n         <p align=\"center\"><strong>IMPORTANT - YOU SHOULD READ THIS CAREFULLY</strong></p>\r\n         <br/>\r\n         <p align=\"center\"><strong>NOTICE OF DEFAULT SUMS</strong></p>\r\n         <br/>\r\n         <p align=\"center\">Served under section 86E of the Consumer Credit Act 1974</p>\r\n         <br/>\r\n         <p align=\"left\">This Notice of Default Sums now served on you relates to a Fixed-Sum credit Agreement, number {{lead_id}} and dated {{fund_dt}} entered into by you with {% chunk \"new-lender-name\" %}.</p>\r\n         <p>This notice is given in compliance with the Consumer Credit Act 1974 because you have defaulted on your payments under the Terms &#38; Conditions.</p>\r\n         <p>This Notice does not take account of default sums which we have already told you about in another default sums notice, whether or not those sums remain unpaid.</p>\r\n         <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n             <thead>\r\n                 <tr>\r\n                     <th style=\"background:#e6e6fa;\">\r\n                         Date Payable\r\n                     </th>\r\n                     <th style=\"background:#e6e6fa;\">\r\n                         Nature of Default\r\n                     </th>\r\n                     <th style=\"background:#e6e6fa;\">\r\n                         Default Sum (&pound;)\r\n                     </th>\r\n                 </tr>\r\n             </thead>\r\n             {% for value in table %}\r\n             <tr>\r\n                 <td>{{value|get:\"Date Payable\"}}</td>\r\n                 <td>{{value|get:\"Nature of Default\"|floatformat:2}}</td>\r\n                 <td>{{value|get:\"Default Sum(&pound)\"|floatformat:2}}</td>\r\n             </tr>\r\n             {% endfor %}\r\n             <tr>\r\n                 <td>Total Default Sums Due:</td>\r\n                 <td></td>\r\n                 <td>{{Repayment_Amounts}}</td>\r\n             </tr>\r\n         </table>\r\n         <p>You are encouraged to contact us to discuss the state of your account. Our contact details are: Lending Stream, {{lender_street1}}, {{lender_street2}}, {{lender_city}}, {{lender_county}}, {{lender_postcode}}; Tel: {{customercare_contact_tp}};</p>\r\n         <p>Contact: {% chunk \"contactus-url\" %}.</p>\r\n         <p><strong>Notices</strong></p>\r\n         <p>You have not been charged for the preparation or delivery of this notice.</p>\r\n         <p>Regards,\r\n             <br/>Customer Care Team\r\n             <br/>{{lender_name}}.</p>\r\n          <!-- html content end -->\r\n          <div id=\"footerContent\">\r\n               <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n               Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br />\r\n               Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n         </div>\r\n     </div>\r\n \r\n </body>\r\n </html>','notice of default sums',1,1,'2016-05-10 19:11:36.490789','2016-05-10 19:11:36.492730','2017-12-08 09:28:58.000000',1,2,''),('notice-of-sum-in-arrears','{% load chunks %}\r\n {% load space_filter %}\r\n <!DOCTYPE HTML>\r\n <!DOCTYPE HTML>\r\n <HTML>\r\n <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n     \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n     <html>\r\n     <head>\r\n         <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n         <style type=\"text/css\" media=\"all\">\r\n             @page {\r\n             margin: 0.5cm;\r\n             margin-top:1.8cm;   \r\n             margin-bottom: 1.8cm;\r\n             @frame footer {\r\n             -pdf-frame-content: footerContent;\r\n             bottom: 0cm;\r\n             margin-left: 0.75cm;\r\n             margin-right: 0.75cm;            \r\n             font-size:8px;\r\n             height: 1.5cm;\r\n             }           \r\n             }\r\n         </style>\r\n     </head>\r\n     <body>\r\n          <!--html content-->\r\n          <table width=\"100%\">\r\n             <tr>\r\n                 <td></td>\r\n                 <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n             </tr>\r\n         </table>\r\n         <p align=\"right\">\r\n             <font color=\"SteelBlue\">{{lender_name}},\r\n                 <br/>{{lender_street1}},\r\n                 <br/>{{lender_street2}},\r\n                 <br/>{{lender_city}},\r\n                 <br/>{{lender_county}},\r\n                 <br/>{{lender_postcode}}, {{lender_country}}.\r\n                 <br/>{{customercare_contact_tp}},\r\n                 <br/> W:{{lender_website}}</font>\r\n         </p>\r\n              <p align=\"left\">\r\n             {% if cust_Prefix %}\r\n             {{cust_Prefix|title}} &nbsp;\r\n             {%endif%}\r\n             {% if cust_firstname %}\r\n             {{cust_firstname}}&nbsp;\r\n             {%endif%} \r\n             {% if cust_middlename %}\r\n             {{cust_middlename}} &nbsp;\r\n             {%endif%}\r\n             {% if cust_lastname %}\r\n             {{cust_lastname}}\r\n             {%endif%}\r\n             <br/>{% if Apt_No %} {{Apt_No}} {%endif%} {% if Build_Name %} {{Build_Name}} {%endif%}\r\n             <br/>{% if Build_No %} {{Build_No}} {%endif%} {% if Street %} {{Street}} {%endif%}\r\n             <br/>{% if county %} {{county}} {%endif%} {% if city %} {{city}} {%endif%}\r\n             <br/>{% if postcode %} {{postcode}} {%endif%}</p>\r\n         <p align=\"right\">{{cur_Date}}</p>\r\n         <p align=\"center\"><strong><u>IMPORTANT &#8211; YOU SHOULD READ THIS CAREFULLY</u></strong>\r\n             <br>\r\n             <strong align=\"center\"><u>NOTICE OF SUMS IN ARREARS</u></strong>\r\n             <br>\r\n             <strong align=\"center\">Served under Section 86B of the Consumer Credit Act 1974</strong></p>\r\n         <p align=\"left\">This Notice of Sums in Arrears now served on you relates to a Fixed-Sum Credit Agreement number {{lead_id}} and dated {{fund_dt}} entered into by you with {% chunk \"new-lender-name\" %} of the above address.</p>\r\n         <p>This notice is given in compliance with the Consumer Credit Act 1974 because you are behind with your payments under the agreement.</p>\r\n         <p> The opening balance under the agreement on the date when the duty to give this notice arose on {{daily_notice_date}} is &pound;{{open_balance|floatformat:2}}. This figure excludes contractual interest that has not yet been added to the account but includes any default fees that you have incurred.</p>\r\n         <p> The amount of the shortfall(comprised of the payment that you have missed) as at {{daily_notice_date}} is &pound;{{arrears_amount|floatformat:2}}. This shortfall is compromised as follows:</p>\r\n         <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n             <thead>\r\n                 <tr>\r\n                     <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                         Due Date\r\n                     </th>\r\n                     <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                         Amounts Due (&pound;)\r\n                     </th>\r\n                     <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                         Payments (&pound;)\r\n                     </th>\r\n                     <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                         Balance due (&pound;)\r\n                             <br>(cumulative)\r\n                     </th>\r\n                 </tr>\r\n             </thead>\r\n             {% for value in table %}\r\n             <tr>\r\n                 <td>{{value|get:\"Due Date\"}}</td>\r\n                 <td>&pound;{{value|get:\"Amounts Due(&pound)\"|floatformat:2}}</td>\r\n                 <td>&pound;{{value|get:\"Payments Recieved\"|floatformat:2}}</td>\r\n                 <td>&pound;{{value|get:\"Balance Due(&pound) (cumilative)\"|floatformat:2}}</td>\r\n             </tr>\r\n             {% endfor %}\r\n         </table>\r\n         <br />\r\n         <p>If you want more information about which payments you failed to make, please get in touch with us. We are required to give you this information within {{max_payinfo_days}} days of receiving your request for it.</p>\r\n         <p>You are encouraged to contact us to discuss your account. Our contact details are provided above.</p>\r\n         <p><strong>Financial Conduct Authority Information Sheet</strong></p>\r\n         <p>This notice should include a copy of the current information sheet on arrears prepared by the Financial Conduct Authority. This contains important information about your rights and where to go for support and advice, for example on applying for a Time Order as well as our right to charge you interest. If it is not included you should contact us to get one.</p>\r\n         <p>Please refer to the Financial Conduct Authority information sheet for more information about how to get advice on dealing with your debt.</p>\r\n         <p><strong>Default sums and Interest</strong></p>\r\n         <p>You may have to pay default sums and interest in relation to the missed or partly made payments referred to in this notice. Please contact us if you would like further details. This notice does not take into account any payments received after the date of the notice. </p>\r\n         <p><strong>Notices</strong></p>\r\n         <p>For so long as you continue to be behind with your payments by any amount, you will be sent notices about this at least every six months. We are not required to send you notices more frequently than this, even if you get further behind with your payments in between notices.</p>\r\n         <p>You have not been charged for the preparation or delivery of this notice.</p>\r\n          <!-- html content end -->\r\n        \r\n \r\n         <div id=\"footerContent\">\r\n               <div class=\"footer\" style=\"text-align:center;color:steelblue;font-size:12px;\">\r\n                 Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br/>\r\n Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111 Page <pdf:pagenumber/>\r\n               </div>\r\n         </div>\r\n     <div id=\"footerContent\">\r\n               <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n               Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br />\r\n               Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n         </div>\r\n     </div>\r\n \r\n </body>\r\n </html>','notice of sum in arrears',1,1,'2016-05-10 19:04:55.984737','2016-05-10 19:04:55.985703','2017-12-08 09:28:58.000000',1,2,''),('retro-ta-dmp-fnosia','{% load chunks %}\r\n     {% load space_filter %}\r\n     <!DOCTYPE HTML>\r\n     <!DOCTYPE HTML>\r\n     <HTML>\r\n     <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n         \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n         <html>\r\n         <head>\r\n             <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n             <style type=\"text/css\" media=\"all\">\r\n                 @page {\r\n                 margin: 0.5cm;\r\n                 margin-top:1.8cm;\r\n                 margin-bottom: 1.8cm;\r\n                 @frame footer {\r\n                 -pdf-frame-content: footerContent;\r\n                 bottom: 0cm;\r\n                 margin-left: 0.75cm;\r\n                 margin-right: 0.75cm;\r\n                 font-size:8px;\r\n                 height: 1.5cm;\r\n                 }\r\n                 }\r\n             </style>\r\n         </head>\r\n         <body>\r\n              <!--html content-->\r\n              <table width=\"100%\">\r\n                 <tr>\r\n                     <td></td>\r\n                     <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n                 </tr>\r\n             </table>\r\n             <p align=\"right\">\r\n                 <font color=\"SteelBlue\">{{lender_name}}\r\n                     <br/>{{lender_street1}}\r\n                     <br/>{{lender_street2}}\r\n                     <br/>{{lender_city}}\r\n                     <br/>{{lender_county}}\r\n                     <br/>{{lender_postcode}}\r\n                     <br/>{{lender_country}}\r\n                     <br/>Customer Service Telephone: {{customercare_contact_tp}}\r\n                     <br/> Contact us at: {{contact_us}}</font>\r\n             </p>\r\n                  <p align=\"left\">\r\n                 {% if cust_Prefix %}{{cust_Prefix|title}} {%endif%}{% if cust_firstname %}{{cust_firstname}} {%endif%}{% if cust_middlename %}{{cust_middlename}} {%endif%}{% if cust_lastname %}{{cust_lastname}}{%endif%}\r\n                 {% if Apt_No or Build_Name %}<br/>{% if Apt_No %} {{Apt_No}} {%endif%} {% if Build_Name %} {{Build_Name}} {%endif%}{%endif%}\r\n                 <br/>{% if Build_No %} {{Build_No}} {%endif%} {% if Street %} {{Street}} {%endif%}\r\n                 <br/>{% if county %} {{county}} {%endif%} {% if city %} {{city}} {%endif%}\r\n                 <br/>{% if postcode %} {{postcode}} {%endif%}</p>\r\n             <p align=\"right\">{{run_Date}}</p>\r\n             <p align=\"center\"><strong><u>IMPORTANT &#8211; YOU SHOULD READ THIS CAREFULLY</u></strong>\r\n                 <br>\r\n                 <strong align=\"center\"><u>NOTICE OF SUMS IN ARREARS</u></strong>\r\n                 <br>\r\n                 <strong align=\"center\">Served under Section 86B of the Consumer Credit Act 1974</strong></p>\r\n             <p align=\"left\">This Notice of Sums in Arrears now served on you relates to a Fixed-Sum Credit Agreement (number {{lead_id}} and dated {{fund_dt}}) entered into by you with {% chunk \"new-lender-name\" %} of the above address.</p>\r\n             {% if doc_category == \"TA_DMP_FNOSIA\" %}\r\n             <p>Although you are currently on a repayment plan with us, we are required to send you this notice in compliance with the Consumer Credit Act 1974 because you are behind with your contractual payments under the agreement.  Unless we tell you otherwise, we will continue to accept repayments from you in accordance with your repayment plan.  </p>\r\n             {% else %}\r\n             <p>This notice is given in compliance with the Consumer Credit Act 1974 because you are behind with your payments under the agreement.</p>\r\n             <p>You are encouraged to contact us to discuss your account. Our contact details are provided above.</p>\r\n             {% endif %}\r\n \r\n \r\n             <p>The amounts and dates of any sums you have paid us and the amount and dates any interest or other charges that have become due during the period covered by this notice are shown below.</p>\r\n \r\n             <p>Period covered by this Notice: {{triggered_Date}} to {{run_Date}}</p>\r\n \r\n             <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n                 <thead>\r\n                     <tr>\r\n                         <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                             Date\r\n                         </th>\r\n                         <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                            Interest/Charges (&pound;)\r\n                         </th>\r\n                         <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                             Payments (&pound;)\r\n                         </th>\r\n                         <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                             Waiver (&pound;)\r\n                         </th>\r\n                         <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                             Refund (&pound;)\r\n                         </th>\r\n                         <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                           Outstanding Balance (&pound;)\r\n                         </th>\r\n                         <th valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                           Cumulative shortfall (&pound;)\r\n                         </th>\r\n                     </tr>\r\n                 </thead>\r\n                 {% for value in table %}\r\n                 <tr>\r\n                     <td>{{value|get:\"Date\"}}</td>\r\n                     <td>&pound;{{value|get:\"Interest/Charges\"|floatformat:2}}</td>\r\n                     <td>&pound;{{value|get:\"Payments(&pound)\"|floatformat:2}}</td>\r\n                     <td>&pound;{{value|get:\"Waiver(&pound)\"|floatformat:2}}</td>\r\n                     <td>&pound;{{value|get:\"Refund(&pound)\"|floatformat:2}}</td>\r\n                     <td>&pound;{{value|get:\"Outstanding Balance(&pound) (cumilative)\"|floatformat:2}}</td>\r\n                     <td>&pound;{{value|get:\"Cumulative shortfall(&pound) (cumilative)\"|floatformat:2}}</td>\r\n                 </tr>\r\n                 {% endfor %}\r\n             </table>\r\n             <br />\r\n             <p>You are encouraged to contact us to discuss your account. Our contact details are provided above.</p>\r\n             <p><strong>Default sums and Interest</strong></p>\r\n             <p>You may have to pay default sums and interest in relation to the missed or partly made payments referred to in this notice (in addition to any default sums and interest included in this notice). Please contact us if you would like further details. This notice does not take into account any payments received after the date of the notice.</p>\r\n \r\n             <p><strong>Notices</strong></p>\r\n             <p>For so long as you continue to be behind with your payments by any amount, you will be sent notices about this at least every six months. We are not required to send you notices more frequently than this, even if you get further behind with your payments in between notices.</p>\r\n             <p>You have not been charged for the preparation or delivery of this notice.</p>\r\n \r\n             <p><strong>Financial Conduct Authority Information Sheet</strong></p>\r\n             <p>This notice should include a copy of the current information sheet on arrears prepared by the Financial Conduct Authority. This contains important information about your rights and where to go for support and advice, for example on applying for a Time Order as well as our right to charge you interest. If it is not included you should contact us to get one.</p>\r\n \r\n             <p>Please refer to the Financial Conduct Authority information sheet for more information about how to get advice on dealing with your debt. </p>\r\n \r\n             <p>Regards,</p>\r\n             <p>Lending Stream Customer Care Team</p>\r\n             <p>Call charges apply. Standard charges from BT landlines, mobiles and other providers may vary.</p>\r\n              <!-- html content end -->\r\n             <div id=\"footerContent\">\r\n                   <div class=\"footer\" style=\"text-align:center;color:steelblue;font-size:12px;\">\r\n                     Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br/>\r\n     Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111 Page <pdf:pagenumber/>\r\n                   </div>\r\n             </div>\r\n         <div id=\"footerContent\">\r\n                   <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n                   Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br />\r\n                   Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n             </div>\r\n         </div>\r\n \r\n     </body>\r\n     </html>','retro-ta-dmp-fnosia',1,1,'2018-12-11 08:27:54.769737','2018-12-11 08:28:06.400384','2018-12-11 08:28:17.678357',1,2,''),('secci','{% load chunks %}\r\n {% load space_filter %}\r\n <!DOCTYPE HTML>\r\n <HTML>\r\n <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n     \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n     <html>\r\n     <head>\r\n         <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n         <style type=\"text/css\" media=\"all\">\r\n             @page {\r\n             margin: 0.5cm;\r\n             margin-top:1.8cm;\r\n             margin-bottom: 1.8cm;\r\n             @frame footer {\r\n             -pdf-frame-content: footerContent;\r\n             bottom: 0cm;\r\n             margin-left: 0.75cm;\r\n             margin-right: 0.75cm;\r\n             font-size:8px;\r\n             height: 1.5cm;\r\n             }\r\n             }\r\n         </style>\r\n     </head>\r\n     <body>\r\n       <!--html content-->\r\n       <table width=\"100%\">\r\n          <tr>\r\n              <td></td>\r\n              <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n          </tr>\r\n      </table>\r\n      <p align=\"right\">\r\n        Contact Address:<br/>\r\n          <font color=\"SteelBlue\">{% chunk \"lender-name\" %} ,\r\n              <br/>{% chunk \"lender-street1\" %},\r\n              <br/>{% chunk \"lender-street2\" %},\r\n              <br/>{% chunk \"lender-county\" %}, {% chunk \"lender-city\" %},\r\n              <br/>{% chunk \"lender-country\" %}, {% chunk \"lender-postcode\" %}\r\n              <br/>Telephone number: {% chunk \"adeptra-contact\" %}\r\n              <br/>Contact:  {% chunk \"contactus-url\" %}</font>\r\n      </p>\r\n <div id=\"print_secci_body\">\r\n <h2 align=\"center\" style=\"font-size:18px;\">Pre-Contract Credit Information</h2>\r\n <table width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n   <tr>\r\n     <td align=\"center\">\r\n       <p style=\"font-size:16px;\">Standard European Consumer Credit Information (SECCI)</p></td>\r\n   </tr>\r\n </table>\r\n <p style=\"font-size:14px;\"><strong>1. Contact details</strong></p>\r\n <table width=\"100%\" border=\"1\" cellspacing=\"0\" cellpadding=\"10\">\r\n   <tr>\r\n     <td align=\"left\" width=\"50%\">Creditor.</td>\r\n     <td align=\"left\" width=\"50%\">{% chunk \"new-lender-name\" %}</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Address.</td>\r\n     <td align=\"left\">{% chunk \"contact-address-single-line\" %}</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Telephone number.</td>\r\n     <td align=\"left\">{% chunk \"adeptra-contact\" %}</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Contact.</td>\r\n     <td align=\"left\">{% chunk \"contactus-url\" %}</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Web address.</td>\r\n     <td align=\"left\"><a target=\'_blank\' href=\"http://www.lendingstream.co.uk\">www.lendingstream.co.uk</a></td>\r\n   </tr>\r\n </table>\r\n <p style=\"font-size:14px;\"><strong>2.\r\n   Key features of the credit product</strong></p>\r\n <table width=\"100%\" border=\"1\" cellspacing=\"0\" cellpadding=\"10\">\r\n   <tr>\r\n     <td align=\"left\" width=\"50%\">The type of credit.</td>\r\n     <td align=\"left\" width=\"50%\">\r\n   {% ifequal product_details.product_type \"EXI\" %}\r\n   Fixed sum short term {{no_of_cycles}} weeks instalment loan.\r\n   {% else %}\r\n   Fixed sum short term {{no_of_cycles}} months instalment loan.\r\n   {% endifequal %}</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">The total amount of credit. This means the amount of credit to be provided under the proposed credit agreement or the credit limit.</td>\r\n     <td align=\"left\">&pound;{{ confirmed_amount }}</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">How and when credit would be provided.</td>\r\n     <td align=\"left\">{% chunk \"new-lender-name-only\" %} (\"Lending Stream\") will credit a bank account nominated by you with the amount of credit following the execution of the credit agreement. Such transfer will be free of charge through the Faster Payments Service (FPS) if supported by your bank.\r\n </td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">The duration of the credit agreement.\r\n </td>\r\n     <td align=\"left\">{{ loanterm_indays }} days</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Repayments.</td>\r\n     <td align=\"left\">{{ no_of_cycles }} repayments on each of the dates and amounts set out below.\r\n       <table width=\"200\" border=\"1\" cellspacing=\"0\" cellpadding=\"3\" style=\"font-size:11px\">\r\n         <tr>\r\n           <td width=\"47%\" height=\"24\" align=\"center\" style=\"font-size:11px\"><strong>Date</strong></td>\r\n           <td width=\"53%\" align=\"center\" style=\"font-size:11px\"><strong>Amount</strong></td>\r\n         </tr>\r\n   {% ifequal product_details.product_type \"EXI\" %}\r\n         {% for sub in payment_schedule %}\r\n         <tr>\r\n           <td align=\"center\" height=\"27\">{{ sub.paymentdate|date_formatter }}</td>\r\n           <td align=\"center\">&pound;{{ sub.interest|addf:sub.principal }}</td>\r\n         </tr>\r\n         {% endfor %}\r\n         {% else %}\r\n         {% for sub in payment_schedule %}\r\n         <tr>\r\n           <td align=\"center\" height=\"27\">{{ sub.paymentdate|date_formatter }}</td>\r\n           {% ifequal sub.principal 0 %}\r\n             <td align=\"center\">&pound;{{ sub.interest|addf:sub.principal }} ( &pound;{{ sub.interest|floatformat:2 }} interest)</td>\r\n           {% else %}\r\n             <td align=\"center\">&pound;{{ sub.interest|addf:sub.principal }} ( &pound;{{ sub.interest|floatformat:2 }} interest plus &pound;{{ sub.principal|floatformat:2 }})</td>\r\n           {% endifequal %}\r\n         </tr>\r\n         {% endfor %}\r\n         {% endifequal %}\r\n       </table></td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">The total amount you will have to pay. This means the amount you have borrowed plus interest and other costs.</td>\r\n     <td align=\"left\">The Total Amount Payable = &pound;{{ total_repayment|floatformat:2 }}, being the sum of the Principal of &pound;{{ confirmed_amount|floatformat:2 }} and Interest of &pound;{{ total_term_interest|floatformat:2 }}.</td>\r\n   </tr>\r\n </table>\r\n <p style=\"font-size:14px;\"><strong>3.\r\n   Costs of the credit</strong></p>\r\n <table width=\"100%\" border=\"1\" cellspacing=\"0\" cellpadding=\"10\">\r\n   <tr>\r\n     <td align=\"left\" width=\"50%\">The rates of interest which apply to your Loan Agreement.\r\n </td>\r\n     <td align=\"left\" width=\"50%\">\r\n      {% ifequal product_details.product_type \"EXI\" %}\r\n         {{product_details.interest_rate}}% of the capital balance outstanding (or &pound;{{product_details.interest_rate|floatformat:2}} per &pound;100.00 outstanding) per payment cycle, equating to {{flatrate_perannum }}% per annum. Interest is calculated and applied to the capital balance outstanding at the beginning of each day.\r\n      {% else %}\r\n      {% if flatrate_perannum == \"DI\" %}\r\n   {{product_details.interest_rate}}% of the capital balance outstanding (or &pound;{{product_details.interest_rate|floatformat:2}} per &pound;100.00 outstanding) per payment cycle, equating to {{flatrate_perannum }}% per annum. Interest is calculated and applied to the capital balance outstanding at the beginning of each day.\r\n    {% else %}\r\n    {{product_details.interest_rate}}% of the capital balance outstanding (or &pound;{{product_details.interest_rate|floatformat:2}} per &pound;100.00 outstanding) per payment cycle, equating to {{flatrate_perannum }}% per annum. A payment cycle will usually be the period of one month, being the period between your paydays, but the first payment cycle may be shorter or longer than a month as it will run from the date you take out the loan until your next payday, or, if your next payday is within 8 days of the date you take out the loan, to the payday afterwards.  Interest is calculated and applied to the capital balance outstanding at the beginning of each payment cycle. If you repay your loan early and in full during a cycle, you will incur interest for the entirety of the cycle during which you make early repayment, but you will not be charged interest for what would have been the remainder of the loan term.  Thus, early repayment of your loan in full prior to the start of the final cycle will result in savings on interest that otherwise would have been owed.\r\n    {% endif %}\r\n      {% endifequal %}\r\n   </td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Annual Percentage Rate of Charge (APR). This is the total cost expressed as an annual percentage of the total amount of credit. The APR is there to help you compare different offers.</td>\r\n     {% if product_details.product_type == \"DI\" %}\r\n     <td align=\"left\">{{ apr }}% APR.</td>\r\n     {% else %}\r\n     <td align=\"left\">{{ apr }}% APR. The APR is calculated on the assumption that both parties comply with the terms of the agreement; i.e. you borrow the amount of credit shown above and repay over {{ no_of_cycles }} repayment instalments on the dates and amounts shown above.</td>\r\n     {% endif %}\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Related Costs</td>\r\n     <td align=\"left\"></td>\r\n   </tr>\r\n   {% if product_details.product_type == \"DI\" %}\r\n   <tr>\r\n     <td align=\"left\">Costs in the case of late payments.</td>\r\n     <td align=\"left\">On the first occasion that you do not pay on time, Lending Stream will apply a default charge of up to &pound;15.  If it happens again and we did not charge you the full &pound;15 default charge the first time, we will apply a further charge that will result in combined default charges amounting to &pound;15.  You may also be required to pay us interest on sums in arrears at the contractual interest rate, but you will not be liable to pay such interest charges in respect of periods beyond the 60th day after the final payment is due.\r\n If you fail to repay us on time, you will never have to pay back in total more than twice the Amount of Credit (i.e. what you have borrowed).\r\n   </td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Consequences of missing payments.</td>\r\n     <td align=\"left\">Missing payments will require you to pay more than the amounts set out in your agreement, which means that the total cost of your debt will grow.  If you don\'t make your payments on time we may record this at Credit Reference Agencies and this may make obtaining credit more difficult and more expensive in the future. If you become insolvent this will remain on your file for 6 years. Missing payments could also result in legal action being taken against you(including a charging order being sought over your home), which could result in a court order being obtained and you incurring legal costs.  If a court order secures any outstanding debt against your home, this could lead to your home being repossessed.</td>\r\n   </tr>\r\n   {% else %}\r\n     <tr>\r\n     <td align=\"left\">Costs in the case of late payments.</td>\r\n     <td align=\"left\"><p>On each occasion that you do not pay on time, Lending Stream will apply a default charge of up to &pound;5. We will not charge you more than a total of &pound;15 in default charges. You may also be required to pay us interest on your principal sums in arrears at the contractual interest rate, but you will not be liable to pay such interest charges in respect of periods beyond the 60th day after the final payment is due.</p>\r\n   <p> If you fail to repay us on time, you will never have to pay back in total more than twice the Amount of Credit (i.e. what you have borrowed).</p>\r\n     </td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Consequences of missing payments.</td>\r\n     <td align=\"left\">Missing payments will require you to pay more than the amounts set out in your agreement, which means that the total cost of your debt will grow.  If you don\'t make your payments on time we may record this at Credit Reference Agencies and this may make obtaining credit more difficult and more expensive in the future. If you become insolvent this will remain on your file for 6 years. Missing payments could also result in legal action being taken against you, which could result in a court order being obtained and you incurring legal costs.  If a court order secures any outstanding debt against your home, this could lead to your home being repossessed.</td>\r\n   </tr>\r\n   {% endif %}\r\n </table>\r\n <p style=\"font-size:14px;\"><strong>4. Other important legal aspects</strong></p>\r\n <table width=\"100%\" border=\"1\" cellspacing=\"0\" cellpadding=\"10\">\r\n   <tr>\r\n     <td align=\"left\" width=\"50%\">Right of Withdrawal.</td>\r\n     <td align=\"left\" width=\"50%\">You have the right, under section 66A of the Consumer Credit Act 1974, to withdraw from the credit agreement without giving any reason for doing so for a period of 14 days beginning with the day after the day on which you receive a copy of the executed credit agreement</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Early repayment.</td>\r\n     <td align=\"left\">You have the right to repay the credit early at any time in full or partially.</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Consultation  with a Credit Reference Agency.</td>\r\n     <td align=\"left\">If Lending Stream decides not to proceed with your credit agreement on the basis of information from a Credit Reference Agency, Lending Stream must inform you of this and provide particulars of the credit reference agency, when informing you of the decision.</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Right to draft of the credit agreement.</td>\r\n     <td align=\"left\">You have the right, upon request, to obtain a copy of the draft credit agreement free of charge, unless Lending Stream is unwilling at the time of the request to proceed to the conclusion of the credit agreement.</td>\r\n   </tr>\r\n </table>\r\n {% if product_details.product_type == \"DI\" %}\r\n <p style=\"font-size:14px;\"><strong>5.  Additional information in the case of distance marketing of financial services</strong></p>\r\n {% else %}\r\n <p style=\"font-size:14px;\"><strong>5.  Additional information to be given in the case of distance marketing of financial services</strong></p>\r\n {% endif %}\r\n <table width=\"100%\" border=\"1\" cellspacing=\"0\" cellpadding=\"10\">\r\n   <tr>\r\n     <td align=\"left\" width=\"50%\">(a) concerning the creditor</td>\r\n     <td align=\"left\" width=\"50%\">&nbsp;</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Registration Number.</td>\r\n     <td align=\"left\">{% chunk \"new-lender-name\" %} has a registration number of 689378.</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">The Supervisory Authority.</td>\r\n     <td align=\"left\">The Financial Conduct Authority, 25 The North Colonnade, Canary Wharf, London, E14 5HS .</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">(b) concerning the credit agreement</td>\r\n     <td align=\"left\"><br></td>\r\n   </tr>\r\n   <tr>\r\n     {% if product_details.product_type == \"DI\" %}\r\n     <td align=\"left\">The law taken by the creditor as a basis for the establishment of relations with you before the conclusion of the credit agreement.</td>\r\n     {% else %}\r\n     <td align=\"left\">The law taken by the Creditor as a basis for the establishment of relations with you before the conclusion of the credit contract.</td>\r\n     {% endif %}\r\n     <td align=\"left\">English law (Scottish law if you live there).</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">The law applicable to the credit agreement and/or the competent court.</td>\r\n     <td align=\"left\">The laws of England and Wales (or Scotland if you live there) will be taken as a basis for the establishment of relations between us and you before the conclusion of the credit agreement. The courts of England and Wales or Scotland (as appropriate to the borrower) will have exclusive jurisdiction over matters arising in relation to this credit agreement. </td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Language to be used in connection with the credit agreement.</td>\r\n     <td align=\"left\">The contractual terms and conditions, and the prior information, are in English. Lending Stream undertake, with your agreement, to communicate with you in English for the duration of the credit agreement.</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">(c) concerning redress</td>\r\n     <td align=\"left\">&nbsp;</td>\r\n   </tr>\r\n   <tr>\r\n     <td align=\"left\">Access to out-of-court complaint and redress mechanism.</td>\r\n     <td align=\"left\">If you have a complaint about the credit agreement or any dealings with us, please contact us online at {% chunk \"contactus-url\" %} and you can telephone us on {% chunk \"adeptra-contact\" %}.  If we are unable to resolve your complaint, you will have the right to complain to the Financial Ombudsman Service. You can find out more about The Financial Ombudsman Service in a leaflet available by contacting us. Alternatively you can write to: The Financial Ombudsman Service, Exchange Tower, London, E14 9SR, you can telephone: 0800 0234567 or 0300 123 9123 or you can e-mail: <a href=\"mailto:complaintinfo@financial-ombudsman.org.uk\">complaintinfo@financial-ombudsman.org.uk</a>.</td>\r\n   </tr>\r\n </table>\r\n </td>\r\n </tr>\r\n </table>\r\n \r\n </div>\r\n     <div id=\"footerContent\">\r\n               <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n               Authorised and Regulated by the Financial Conduct Authority. Registration Number 689378.<br />\r\n               Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n         </div>\r\n     </div>\r\n </body>\r\n </html>','secci',1,1,'2016-05-10 19:06:38.986206','2016-05-10 19:06:38.987103','2017-12-08 09:28:58.000000',1,2,''),('statement-of-account','{% load chunks %}\r\n  <!DOCTYPE HTML>\r\n  <HTML>\r\n  <!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n      \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n      <html>\r\n      <head>\r\n          <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n          <style type=\"text/css\" media=\"all\">\r\n              @page {\r\n              margin: 0.5cm;\r\n              margin-top:1.8cm;   \r\n              margin-bottom: 1.8cm;\r\n              @frame footer {\r\n              -pdf-frame-content: footerContent;\r\n              bottom: 0cm;\r\n              margin-left: 0.75cm;\r\n              margin-right: 0.75cm;            \r\n              font-size:8px;\r\n              height: 1.5cm;\r\n              }           \r\n              }\r\n          </style>\r\n      </head>\r\n      <body>\r\n           <!--html content-->\r\n           <table width=\"100%\">\r\n              <tr>\r\n                  <td></td>\r\n                  <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n              </tr>\r\n          </table>\r\n          <p align=\"right\">\r\n              <font color=\"SteelBlue\">Contact Address:\r\n                  <br/>{{lender_name}},\r\n                  <br/>{{lender_street1}},\r\n                  <br/>{{lender_street2}},\r\n                  <br/>{{lender_city}},\r\n                  <br/>{{lender_county}},\r\n                  <br/>{{lender_postcode}}, {{lender_country}}\r\n                  <br/>\r\n                  <br/>Customer Services T {{customercare_contact_tp}}*</font>\r\n          </p>\r\n          <p align=\"right\">Date: {{today_date}}</p>\r\n          <p align=\"left\">\r\n              {% if cust_Prefix %}\r\n              {{cust_Prefix|title}} &nbsp;\r\n              {%endif%}\r\n              {% if cust_firstname %}\r\n              {{cust_firstname}}&nbsp;\r\n              {%endif%} \r\n              {% if cust_middlename %}\r\n              {{cust_middlename}} &nbsp;\r\n              {%endif%}\r\n              {% if cust_lastname %}\r\n              {{cust_lastname}}\r\n              {%endif%}\r\n              {% if Apt_No or Build_Name %} <br/>{% if Apt_No %} {{Apt_No}} {%endif%} {% if Build_Name %} {{Build_Name}} {%endif%}{%endif%}\r\n              <br/>{% if Build_No %} {{Build_No}} {%endif%} {% if Street %} {{Street}} {%endif%}\r\n              <br/>{% if county %} {{county}} {%endif%} {% if city %} {{city}} {%endif%}\r\n              <br/>{% if postcode %} {{postcode}} {%endif%}\r\n              <br/>\r\n              <br/>\r\n          </p>\r\n          <p align=\"right\">Loan Reference ID: {{loanId}}</p>\r\n          <p align=\"left\">Hi,</p>\r\n          <br>\r\n          <p><b><u>Statement of account for fixed sum credit agreement, pursuant to section 77B of the Consumer Credit Act 1974</u></b></p>\r\n          <p>As requested, we are writing to provide you with a statement for the Fixed Sum Loan Agreement, dated {{commencement_dt}} with the above mentioned Loan Reference ID, between you and {% chunk \"new-lender-name\" %}.</p>\r\n          <p>The statement contains a brief account summary of your loan. This statement provides details of the date, amount of each instalment and other repayments in addition to the regular instalments. The statement comprises details of future payable due and past payment history.{%if other_payments%}You have made partial early settlement(s) towards your outstanding balance as illustrated under section Other Payments . This will be adjusted to your future payment cycle, provided you do not default the upcoming cycle payment. {%endif%} </p>\r\n          <p>A breakdown showing Capital, Interests and Default Charges are given below. </p>\r\n  <br><br>\r\n          <p align=\"center\"><b><u>Statement of Fixed Sum Agreement as on {{today_date}}</u></b></p>\r\n          <br><br>\r\n          <p><b>Account Summary</b></p>\r\n          <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n              <tr>\r\n                  <td width=\"50%\">Start Date</td>\r\n                  <td>{{account_summary.start_date}}</td>\r\n              </tr>\r\n             <tr>\r\n                 <td>End Date (As per the original agreement)</td>\r\n                 <td>{{account_summary.end_date}}</td>\r\n             </tr>\r\n			 <tr>\r\n				<td>Loan Amount</td>\r\n				<td>{{borrowed_amt|floatformat:2}}</td>\r\n			 </tr>\r\n              <tr>\r\n                  <td>Outstanding Principal Balance</td>\r\n                  <td>{{account_summary.outstanding_principal_balance|floatformat:2}}</td>\r\n              </tr>\r\n              <tr>\r\n                  <td>Total Amount Paid</td>\r\n                  <td>{{account_summary.total_amount_paid|floatformat:2}}</td>\r\n              </tr>\r\n              <tr>\r\n                  <td>Arrears Payable Including Charges</td>\r\n                  <td>{{account_summary.arrears|floatformat:2}}</td>\r\n              </tr>\r\n          </table>\r\n  <br><br><br><br><br><br>\r\n          <p><b>Repayment Schedule</b></p>\r\n          <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\" style=\"border-bottom: 0; border-left: 0;\">\r\n              <thead>\r\n                  <tr>\r\n                      <th valign=\"middle\" rowspan=\"2\" style=\"background:#e6e6fa; border-left:2px solid black\">\r\n                          Repayment Cycle(s)\r\n                      </th>\r\n                      <th valign=\"middle\" rowspan=\"2\" style=\"background:#e6e6fa;\">\r\n                          Repayment date(s)\r\n                      </th>\r\n                     <th valign=\"middle\" rowspan=\"2\" style=\"background:#e6e6fa;\">\r\n                          Paid Date\r\n                      </th>\r\n                      <th valign=\"middle\" colspan=\"2\" style=\"background:#e6e6fa;\">\r\n                          Principal\r\n                      </th>\r\n                      <th valign=\"middle\" colspan=\"2\" style=\"background:#e6e6fa;\">\r\n                          Interest\r\n                      </th>\r\n                      <th valign=\"middle\" colspan=\"2\" style=\"background:#e6e6fa;\">\r\n                          Default Charges\r\n                      </th>\r\n                      <th valign=\"middle\" rowspan=\"2\" style=\"background:#e6e6fa;\">\r\n                          Total Amount Payable\r\n                      </th>\r\n                  </tr>\r\n                  <tr>\r\n                      <td valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                          Due\r\n                      </td>\r\n                      <td valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                          Paid\r\n                      </td>\r\n                      <td valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                          Due\r\n                      </td>\r\n                      <td valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                          Paid\r\n                      </td>\r\n                      <td valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                          Due\r\n                      </td>\r\n                      <td valign=\"middle\" style=\"background:#e6e6fa;\">\r\n                          Paid\r\n                      </td>\r\n                  </tr>\r\n              </thead>\r\n              {% for value in repayment_schedule %}\r\n              <tr>\r\n                  <td style=\"border-left:2px solid black\">{{value.repayment_cycle}}</td>\r\n                  <td>{{value.repayment_date}}</td>\r\n                 <td>{{value.paid_date}}</td>\r\n                  <td>{{value.principal_due|floatformat:2}}</td>\r\n                  <td>{{value.principal_paid|floatformat:2}}</td>\r\n                  <td>{{value.interest_due|floatformat:2}}</td>\r\n                  <td>{{value.interest_paid|floatformat:2}}</td>\r\n                  <td>{{value.default_due|floatformat:2}}</td>\r\n                  <td>{{value.default_paid|floatformat:2}}</td>\r\n                  <td>{{value.total_payable_amount|floatformat:2}}</td>\r\n              </tr>\r\n              {% endfor %}\r\n              <tr>\r\n                  <td colspan=\"9\" style=\"border-bottom:2px solid black; text-align:right;\">Total</td>\r\n                  <td style=\"border-bottom:2px solid black\">{{total|floatformat:2}}</td>\r\n              </tr>\r\n          </table>\r\n          {%if other_payments%}\r\n          <p><b>Other Payments</b></p>\r\n          <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n              <thead>\r\n                  <tr>\r\n                      <th style=\"background:#e6e6fa;\">\r\n                          Payment Date(s)\r\n                      </th>\r\n                      <th style=\"background:#e6e6fa;\">\r\n                          Payment Type\r\n                      </th>\r\n                      <th style=\"background:#e6e6fa;\">\r\n                          Paid Amount\r\n                      </th>\r\n                  </tr>\r\n              </thead>\r\n              {% for value in other_payments %}\r\n              <tr>\r\n                  <td>{{value.payment_date}}</td>\r\n                  <td>{{value.payment_type}}</td>\r\n                  <td>{{value.paid_amount|floatformat:2}}</td>\r\n              </tr>\r\n              {% endfor %}\r\n          </table>\r\n          {%endif%} \r\n          {%if temporary_arrangement%}\r\n          <p>{%ifequal temp_type \'PTA\'%}\r\n              The Alternate payment schedule as per your request for the repayment cycle(s) {{temp_list}} is reflected underneath.\r\n              {%endifequal%}\r\n  \r\n              {%ifequal temp_type \'FTA\'%}The Alternate payment schedule for the remaining repayment cycle as per your request is reflected underneath.\r\n              {%endifequal%}</p>\r\n  \r\n          <p><b>Temporary Arrangement</b></p>\r\n          <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n              <thead>\r\n                  <tr>\r\n                      <th style=\"background:#e6e6fa;\">\r\n                          Repayment Cycle(s)\r\n                      </th>\r\n                      <th style=\"background:#e6e6fa;\">\r\n                          Payment date(s)\r\n                      </th>\r\n                      <th style=\"background:#e6e6fa;\">\r\n                          Payment Amount\r\n                      </th>\r\n                      <th style=\"background:#e6e6fa;\">\r\n                          Paid Amount\r\n                      </th>\r\n                  </tr>\r\n              </thead>\r\n              {% for value in temporary_arrangement %}\r\n              <tr>\r\n                  <td>{{value.repayment_cycle}}</td>\r\n                  <td>{{value.payment_date}}</td>\r\n                  <td>{{value.payment_amount|floatformat:2}}</td>\r\n                  <td>{{value.paid_amount|floatformat:2}}</td>\r\n              </tr>\r\n              {% endfor %}\r\n          </table>\r\n          {%endif%}\r\n         <p><b>Cost of borrowing</b></p>\r\n         <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n             <tr>\r\n                 <td align=\"center\">Interest as per the schedule</td>\r\n                 <td align=\"center\">{{interest_as_per_schedule|floatformat:2}}</td>\r\n             </tr>\r\n             <tr>\r\n                 <td align=\"center\">Additional interest incurred due to missed payments</td>\r\n                 <td align=\"center\">{{addl_intr_due_to_missed_payments|floatformat:2}}</td>\r\n             </tr>\r\n             <tr>\r\n                 <td align=\"center\">Additional fees incurred due to missed payments</td>\r\n                 <td align=\"center\">{{addl_fees_due_to_missed_payments|floatformat:2}}</td>\r\n             </tr>\r\n             <tr>\r\n                 <td align=\"center\">Cost of borrowing</td>\r\n                 <td align=\"center\">{{total_cost_of_borrowing|floatformat:2}}</td>\r\n             </tr>\r\n         </table>\r\n         <p><b>Consolidated Summary - ({{consolidated_summary.from_date}} - {{consolidated_summary.to_date}})</b></p>\r\n         <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n             <tr>\r\n                 <td>No of Loans Taken Out</td>\r\n                 <td>{{consolidated_summary.no_of_loans}}</td>\r\n             </tr>\r\n             <tr>\r\n                 <td>Fees Incurred</td>\r\n                 <td>{{consolidated_summary.incurred_fees|floatformat:2}}</td>\r\n             </tr>\r\n             <tr>\r\n                 <td>Fees Paid</td>\r\n                 <td>{{consolidated_summary.paid_fees|floatformat:2}}</td>\r\n             </tr>\r\n         </table>\r\n          <p>If you have any queries regarding this information, please contact us online at \r\n{% chunk \"contactus-url\" %}.</p>\r\n          {%if temporary_arrangement%}\r\n          <p>{%ifequal temp_type \'FTA\'%} We may use continuous payment authority to make up to {{cpa_attempts}} attempts to debit your account on the due dates specified in the above Temporary Arrangement Schedule . All other terms and obligations stated in the original loan agreement you signed remain unchanged and active.{%endifequal%} {%ifequal temp_type \'PTA\'%} We may use continuous payment authority to debit your account on the due dates specified in the above Temporary Arrangement Schedule . All other terms and obligations stated in the original loan agreement you signed remain unchanged and active.{%endifequal%}\r\n          </p>\r\n          {%endif%}\r\n          <p>Regards, </p>\r\n          <p>{{lender_name}}\r\n              <br />\r\n              <br/>\r\n          </p>\r\n          <p align=\"left\">* Call charges apply. Standard charges from BT landlines, mobiles and other providers may vary.</p>\r\n           <p align=\"left\">You can compare our loans to other short term lenders <a href=\"https://www.allthelenders.org.uk/#!monthly%7C1%7C3%7C200%7C0%7C%7B%7D%7C131383\"  target=\"_blank\" >here</a>.</p><!-- html content end -->\r\n           <div id=\"footerContent\">\r\n                <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n                Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br />\r\n                Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n          </div>\r\n      </div>\r\n  \r\n  </body>\r\n  </html>','statement of account',1,1,'2016-05-10 19:09:24.777445','2016-05-10 19:09:24.778534','2017-12-08 09:28:58.000000',1,2,''),('temporary-arrangement','{% load chunks %}\r\n{% load staticfiles %} {% load space_filter %}\r\n<!DOCTYPE HTML>\r\n<HTML>\r\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n    \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n    <html>\r\n    <head>\r\n        <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n        <style type=\"text/css\" media=\"all\">\r\n            @page {\r\n            margin: 0.5cm;\r\n            margin-top:1.8cm;   \r\n            margin-bottom: 1.8cm;\r\n            @frame footer {\r\n            -pdf-frame-content: footerContent;\r\n            bottom: 0cm;\r\n            margin-left: 0.75cm;\r\n            margin-right: 0.75cm;            \r\n            font-size:8px;\r\n            height: 1.5cm;\r\n            }           \r\n            }\r\n        </style>\r\n    </head>\r\n    <body>\r\n         <!--html content-->\r\n          <table width=\"100%\">\r\n            <tr>\r\n                <td></td>\r\n                <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n            </tr>\r\n        </table>\r\n        <p align=\"right\">\r\n            <font color=\"SteelBlue\">Contact Address:\r\n                <br/>{{lender_name}},\r\n                <br/>{{lender_street1}},\r\n                <br/>{{lender_street2}},\r\n                <br/>{{lender_city}},\r\n                <br/>{{lender_county}},\r\n                <br/>{{lender_postcode}}, {{lender_country}}.\r\n                <br/>\r\n            </font>\r\n        </p>\r\n        <p align=\"center\"><strong><u>Notice of change in repayment schedule</u></strong>\r\n            <br>\r\n            <p>\r\n                Dear&nbsp;\r\n                {% if cust_Prefix %}\r\n                {{cust_Prefix|title}} &nbsp;\r\n                {%endif%}\r\n                {% if cust_firstname %}\r\n                {{cust_firstname}}&nbsp;\r\n                {%endif%} \r\n                {% if cust_middlename %}\r\n                {{cust_middlename}} &nbsp;\r\n                {%endif%}\r\n                {% if cust_lastname %}\r\n                {{cust_lastname}}\r\n                {%endif%},</p>\r\n            <p>With reference to your loan agreement <strong>(Loan Reference Id : {{loanId}})</strong>, we are writing to confirm our discussions with you. </p>\r\n            <p align=\"left\">We appreciate your concern to repay us the credit owed by you and, given your current financial difficulties, we have decided, as a concession (and without in any way abandoning or modifying any of our rights under the Loan Agreement) to give you some more time to pay the amount you owe us, by allowing you to continue to pay monthly sums in accordance with the following payment schedule:</p>\r\n            \r\n            <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n                <thead>\r\n                    <tr >\r\n                        <th style=\"background:#e6e6fa;\">\r\n                            Payment Dates\r\n                        </th>\r\n                        <th style=\"background:#e6e6fa;\">\r\n                            Repayment Amounts (&pound;)\r\n                        </th>\r\n                    </tr>\r\n                </thead>\r\n                {% for value in table %}\r\n                <tr>\r\n                    <td>{{value|get:\"Payment Dates\"}}</td>\r\n                    <td>{{value|get:\"Repayment Amounts(&pound)\"|floatformat:2}}</td>\r\n                </tr>\r\n                {% endfor %}\r\n            </table>\r\n            <br /> {%if cpa_suppress %}\r\n            <p>\r\n                We note that you have withdrawn your permission for us to use continuous payment authority (CPA) in order to collect your repayment amounts. Please ensure that you make your scheduled payments by using an alternative method of payment as we will not be automatically collecting such payments. You can make payments, for example, by logging into your account at {{lender_url}}, by cheque, or by contacting us at the number below.\r\n            </p>\r\n            {%else%}\r\n            <p>\r\n                We note that you have confirmed that your continuous payment authority (CPA), should be adjusted to reflect the above Payment Dates and Repayment Amounts. For more information about how your CPA works, please refer to your Loan Agreement.\r\n            </p>\r\n            {%endif%}\r\n            <b><p>Please feel free to get in touch with us by visiting {% chunk \"contactus-url\" %} or call us on {{lender_phone1}}. (Call charges apply. Standard charges from BT landlines, mobiles and other providers may vary). We\'re here between {{cc_start_time}}  and {{cc_close_time}}  {{cc_start_day}} - {{cc_close_day}}.\r\n                <p>\r\n                    <p> Regards,\r\n                        <br/>Customer Care Team\r\n                        <br/>{{lender_name}}.</p></b>\r\n                 </p>\r\n         <!-- html content end -->\r\n        <div id=\"footerContent\">\r\n              <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n              Authorised and Regulated by the Financial Conduct Authority.  Registration Number 689378.<br />\r\n              Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n        </div>\r\n    </div>\r\n\r\n</body>\r\n</html>','temporary arrangement',1,1,'2016-05-10 19:12:22.825650','2016-05-10 19:12:22.827401','2017-12-08 09:28:58.000000',1,2,''),('termination-notice','{% load chunks %}\r\n<!DOCTYPE HTML>\r\n<HTML>\r\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n    \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n    <html>\r\n    <head>\r\n        <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n        <style type=\"text/css\" media=\"all\">\r\n            @page {\r\n            margin: 0.5cm;\r\n            margin-top:1.8cm;\r\n            margin-bottom: 1.8cm;\r\n            @frame footer {\r\n            -pdf-frame-content: footerContent;\r\n            bottom: 0cm;\r\n            margin-left: 0.75cm;\r\n            margin-right: 0.75cm;\r\n            font-size:8px;\r\n            height: 1.5cm;\r\n            }\r\n            }\r\n        </style>\r\n    </head>\r\n    <body>\r\n         <!--html content-->\r\n         <table width=\"100%\">\r\n            <tr>\r\n                <td></td>\r\n                <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right  /></td>\r\n            </tr>\r\n        </table>\r\n        <p align=\"right\">\r\n            <font color=\"SteelBlue\">Contact Address:\r\n                <br/>{{lender_name}},\r\n                <br/>{{lender_street1}},\r\n                <br/>{{lender_street2}},\r\n                <br/>{{lender_city}},\r\n                <br/>{{lender_county}},\r\n                <br/>{{lender_postcode}}, {{lender_country}}.\r\n                <br/>\r\n                <br/>Arrears Management T {{customercare_contact_tp}}</font>\r\n        </p>\r\n\r\n            <p align=\"left\">\r\n            {% if cust_Prefix %}\r\n            {{cust_Prefix|title}} &nbsp;\r\n            {%endif%}\r\n            {% if cust_firstname %}\r\n            {{cust_firstname}}&nbsp;\r\n            {%endif%}\r\n            {% if cust_middlename %}\r\n            {{cust_middlename}} &nbsp;\r\n            {%endif%}\r\n            {% if cust_lastname %}\r\n            {{cust_lastname}}\r\n            {%endif%}\r\n            <br/>{% if Apt_No %} {{Apt_No}} {%endif%} {% if Build_Name %} {{Build_Name}} {%endif%}\r\n            <br/>{% if Build_No %} {{Build_No}} {%endif%} {% if Street %} {{Street}} {%endif%}\r\n            <br/>{% if county %} {{county}} {%endif%} {% if city %} {{city}} {%endif%}\r\n            <br/>{% if postcode %} {{postcode}} {%endif%}</p>\r\n        <p>{{cur_Date}}</p>\r\n        <p align=\"center\"><strong><u>Formal Demand Pursuant to Default Notice under the Consumer Credit Act 1974, s 87 (1)</u></strong></p>\r\n        <p>Dear&nbsp;{% if cust_firstname %}{{cust_firstname}}&nbsp;{%endif%}{% if cust_middlename %}{{cust_middlename}}&nbsp;{%endif%}{% if cust_lastname %}{{cust_lastname}}{%endif%}</p>\r\n        <p><strong>RE: Agreement Number: {{LoanId}}</strong></p>\r\n\r\n        {%ifequal interest_frequency \"daily\"%}\r\n\r\n        <p>We refer to the Default Notice which we issued on {{default_Date}} in connection with the above Agreement. We note that the period during which you could remedy the Default has expired on {{daily_notice_date}}, and that we still have not received the Outstanding Payments in arrears.</p>\r\n        <p>In the circumstances, we confirm that we have terminated your Agreement and that the amount you owe us is as follows:</p>\r\n\r\n        {%else%}\r\n\r\n        <p>We refer to the Default Notice which we issued on\r\n        {{default_Date}}\r\n        in connection with the above Agreement. We note that the period during which you could remedy the Default has expired on\r\n        {{termination_Date}},\r\n        and that we still have not received the Outstanding Payments in arrears.</p>\r\n        <p>In the circumstances, we hereby give you formal notice of our intention to terminate the Agreement on the\r\n        {{termination_Date}}\r\n        and to demand payment of the Total Outstanding Payments under the Agreement to be debited from Your Debit Card.</p>\r\n        {%endifequal%}\r\n\r\n        <p>Outstanding Amount in arrears is\r\n        &pound;{{outstanding_arrearAmount|floatformat:2}}</p>\r\n        <p><strong>Details of Payments to be debited:-</strong></p>\r\n        <p>a. Loan Amount (excess to Outstanding Payments in arrears): &pound;{{loan_Amount|floatformat:2}}\r\n            <br/>b. Interest (excess to Outstanding Payments in arrears) : &pound;{{Interest|floatformat:2}}\r\n            <br/>\r\n            {%if interest_frequency != \"daily\"%}\r\n            c. Fees : &pound;{{Fees|floatformat:2}}</p>\r\n            {%endif%}\r\n        <p>Total Outstanding Payments : &pound;{{total_outstandingPayments|floatformat:2}}</p>\r\n        <p>Also, the interest on the Outstanding Loan Amount will continue to accrue until the Total Outstanding Payments are paid. Hence, we request you to kindly pay the Total Outstanding Payments as soon as possible.</p>\r\n        <p>You should be aware that we may take you to court and get a judgement against you requiring you to pay us the money you owe us under the Agreement, you may have to pay us both the amount of the judgement and interest under the Agreement on all the sums owed by you at the date of the judgement until you have paid these in full. This means that even if you pay off the whole amount of the judgement, you may still have a further sum to pay. If you do not settle the balance on your account we may transfer the responsibility for recovery of the debt to one of our debt recovery agents with a view to taking action for recovery.</p>\r\n        <p><b>IF YOU HAVE DIFFICULTY IN PAYING ANY SUM UNDER THE AGREEMENT OR TAKING ANY OTHER ACTION REQUIRED BY THIS NOTICE, YOU CAN APPLY TO THE COURT WHICH MAY MAKE AN ORDER ALLOWING YOU MORE TIME.</b></p>\r\n        <p>IF YOU ARE NOT SURE WHAT TO DO YOU SHOULD GET HELP AS SOON AS POSSIBLE. FOR EXAMPLE, YOU SHOULD CONTACT A SOLICITOR, YOUR LOCAL TRADING STANDARDS DEPARTMENT OR YOUR NEAREST CITIZENS\' ADVICE BUREAU.</p>\r\n        <p>Please contact Lending Stream on {{customercare_contact_tp}} or at the above address if you wish to discuss this matter further.</p>\r\n        <p>Regards,\r\n            <br /> Customer Care Team\r\n            <br /> {{lender_name}}\r\n            <br />\r\n        </p>\r\n         <!-- html content end -->\r\n    <div id=\"footerContent\">\r\n              <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n              Authorised and Regulated by the Financial Conduct Authority. Registration Number 689378.<br />\r\n              Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n        </div>\r\n    </div>\r\n\r\n</body>\r\n</html>','termination notice',1,1,'2016-05-10 19:14:46.636274','2016-05-10 19:14:46.637272','2017-12-08 09:28:58.000000',1,2,''),('variation-notice','{% load chunks %}\r\n{% load space_filter %}\r\n<!DOCTYPE HTML>\r\n<HTML>\r\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\r\n    \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n    <html>\r\n    <head>\r\n        <meta http-equiv=\"Content-Type\" content=\"text/html;charset=iso-8859-1\" />\r\n        <style type=\"text/css\" media=\"all\">\r\n            @page {\r\n            margin: 0.5cm;\r\n            margin-top:1.8cm;\r\n            margin-bottom: 1.8cm;\r\n            @frame footer {\r\n            -pdf-frame-content: footerContent;\r\n            bottom: 0cm;\r\n            margin-left: 0.75cm;\r\n            margin-right: 0.75cm;\r\n            font-size:8px;\r\n            height: 1.5cm;\r\n            }\r\n            }\r\n        </style>\r\n    </head>\r\n    <body>\r\n         <!--html content-->\r\n         <table width=\"100%\">\r\n            <tr>\r\n                <td></td>\r\n                <td width=\"235\"><img src=\"https://image.s6.exacttarget.com/lib/fe971272716d077d75/m/1/4c9994f4-2740-40ef-b16b-71380bff25f3.png\" align=right /></td>\r\n            </tr>\r\n        </table>\r\n        <p align=\"right\">\r\n            <font color=\"SteelBlue\">Contact Address:\r\n                <br/>{{lender_name}},\r\n                <br/>{{lender_street1}},\r\n                <br/>{{lender_street2}},\r\n                <br/>{{lender_city}},\r\n                <br/>{{lender_county}},\r\n                <br/>{{lender_postcode}}, {{lender_country}}.\r\n                <br/>Customer Services T {{lender_phone1}}\r\n                <br/>Contact: {% chunk \"contactus-url\" %}.\r\n                <br/>\r\n            </font>\r\n        </p>\r\n        <p><strong><center>Notice of Variation to Your Fixed Sum Loan Agreement (\"Variation Notice\")</center></strong></p>\r\n        <p>Hi {% if cust_firstname %}{{cust_firstname}}  {%endif%},</p>\r\n        <p>With reference to your Loan Reference Id, {{loanId}} since there <strong>{{reason4NOV1}}</strong>, we are writing to let you know about the following changes in the Fixed Sum Loan Agreement(s) originally seen and signed by you (the Agreement):- </p>\r\n        <br />\r\n        <p>The tables below indicate the Key Financial Information that has changed owing to the {{reason4NOV2}}.</p>\r\n        <p><strong>KEY FINANCIAL INFORMATION</strong></p>\r\n        <br />\r\n        <p><b><font color=\"red\">What has changed?</font></b></p>\r\n        <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n            <thead>\r\n                <tr>\r\n                    <th style=\"background:#e6e6fa;\">\r\n                        Key Financials\r\n                    </th>\r\n                    <th style=\"background:#e6e6fa;\">\r\n                        From\r\n                    </th>\r\n                    <th style=\"background:#e6e6fa;\">\r\n                        To\r\n                    </th>\r\n                </tr>\r\n            </thead>\r\n            {% for value in table %}\r\n            <tr>\r\n                <td>{{value|get:\"Key Financials\"}}</td>\r\n                <td>{{value|get:\"From\"}}</td>\r\n                <td>{{value|get:\"To\"}}</td>\r\n            </tr>\r\n            {% endfor %}\r\n        </table>\r\n        <br /> {%if not interest_frequency == \"daily\"%}\r\n        <p><b><font color=\"green\">What has not changed?</font></b></p>\r\n        <table border=\"1\" align=\"center\" cellspacing=\"0\" cellpadding=\"10\" width=\"100%\" bordercolor=\"black\">\r\n            <thead>\r\n                <tr >\r\n                    <th style=\"background:#e6e6fa;\">\r\n                        Key Financials\r\n                    </th>\r\n                    <th style=\"background:#e6e6fa;\">\r\n                        From\r\n                    </th>\r\n                    <th style=\"background:#e6e6fa;\">\r\n                        To\r\n                    </th>\r\n                </tr>\r\n            </thead>\r\n            {% for value in table %}\r\n            <tr>\r\n                <td>{{value|get:\"Key Financials\"}}</td>\r\n                <td>{{value|get:\"From\"}}</td>\r\n                <td>{{value|get:\"To\"}}</td>\r\n            </tr>\r\n            {% endfor %}\r\n        </table>\r\n        {%endif%}\r\n        <br />\r\n        <p>You may choose to make a single repayment of your entire loan amount or partial repayment of the balance owed before the end of the Term (\"repayment\"), which will comprise the outstanding loan amount and any unpaid Interest charges accrued till the date of prepayment. You also have right to withdraw by notifying us within {{withdraw_notify_days}} days. <strong>The revised Agreement will take effect from {{today_date}}.</strong></p>\r\n        <br />\r\n        <p>Please notify us by online at {% chunk \"contactus-url\" %}.</p>\r\n        <p><strong>All other terms and obligations remain as stated in the Agreement and the Terms and Conditions.</strong></p>\r\n        <p>Regards,\r\n            <br /> {{lender_name}}\r\n            <br />\r\n            <br />\r\n         <!-- html content end -->\r\n       <div id=\"footerContent\">\r\n              <div class=\"footer\" style=\"color:steelblue;text-align:center;font-size:8px;\">\r\n              Authorised and Regulated by the Financial Conduct Authority. Registration Number 689378.<br />\r\n              Registered Address: {% chunk \"LLCRegisteredAddress\" %}. | Registered in the State of Delaware, USA | Registration Number: 4124111\r\n        </div>\r\n    </div>\r\n\r\n</body>\r\n</html>','variation notice',1,1,'2016-05-10 19:15:31.994560','2016-05-10 19:15:31.998899','2017-12-08 09:28:58.000000',1,2,'');
