CREATE TABLE `waterfall_transaction` (
  `waterfall_transaction_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `loan_id` bigint(20) NOT NULL,
  `batch_id` bigint(20) NOT NULL COMMENT 'primary key of waterfall batch',
  `strategy_id` bigint(20) NOT NULL COMMENT 'primary key of waterfall strategy',
  `amount` decimal(13,2) NOT NULL COMMENT 'amount to be paid by customer on his payment date',
  `card_unique_id` bigint(20) NOT NULL COMMENT 'unique id for a card',
  `card_reference_id` bigint(20) NOT NULL COMMENT 'cim transaction id for a card',
  `start_time` datetime NOT NULL COMMENT 'start time of the waterfall transaction',
  `end_time` datetime DEFAULT NULL COMMENT 'end time of the waterfall transaction',
  `transaction_id` varchar(30) DEFAULT NULL COMMENT 'unique id received from transaction middleware',
  `status` varchar(30) DEFAULT NULL COMMENT 'status of the waterfall transaction',
  `created_datetime` datetime NOT NULL,
  `modified_datetime` datetime DEFAULT NULL,
  PRIMARY KEY (`waterfall_transaction_id`),
  KEY `fk_waterfall_transaction_waterfall_status_idx` (`status`),
  KEY `fk_waterfall_transaction_card_unique_idx` (`card_unique_id`),
  KEY `fk_waterfall_transaction_loan1` (`loan_id`),
  KEY `fk_waterfall_transaction_waterfall_batch1` (`batch_id`),
  KEY `fk_waterfall_transaction_waterfall_strategy1` (`strategy_id`),
  KEY `waterfall_txn_end_time_idx` (`end_time`),
  CONSTRAINT `fk_waterfall_transaction_loan1` FOREIGN KEY (`loan_id`) REFERENCES `loan` (`loan_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_waterfall_transaction_waterfall_batch1` FOREIGN KEY (`batch_id`) REFERENCES `waterfall_batch` (`batch_id`),
  CONSTRAINT `fk_waterfall_transaction_waterfall_strategy1` FOREIGN KEY (`strategy_id`) REFERENCES `waterfall_strategy` (`strategy_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
